import { useState, useEffect } from 'react';
import { Card, CardContent, CardHeader, CardTitle, CardDescription } from '@/components/ui/card';
import { Progress } from '@/components/ui/progress';
import { Badge } from '@/components/ui/badge';
import { Tabs, TabsContent, TabsList, TabsTrigger } from '@/components/ui/tabs';
import { ScrollArea } from '@/components/ui/scroll-area';
import { 
  Target, 
  TrendingUp, 
  TrendingDown,
  Award,
  Clock,
  CheckCircle2,
  XCircle,
  Lock,
  Unlock,
  Zap,
  Brain,
  BarChart3,
  Trophy,
} from 'lucide-react';
import { cn } from '@/lib/utils';
import { useAuth } from '@/lib/auth';
import { 
  fetchSkillRatings, 
  fetchTopicUnlocks,
  calculateInterviewReadiness,
  SkillRating,
  TopicUnlock,
  SKILL_TOPICS,
  getTierInfo,
  SkillTier,
} from '@/lib/skillRatingSystem';
import { SkillRatingBadge } from './SkillRatingBadge';

interface SkillProfileProps {
  className?: string;
}

export function SkillProfile({ className }: SkillProfileProps) {
  const { user } = useAuth();
  const [skillRatings, setSkillRatings] = useState<SkillRating[]>([]);
  const [unlocks, setUnlocks] = useState<TopicUnlock[]>([]);
  const [readiness, setReadiness] = useState({
    readiness: 0,
    strongestTopic: null as string | null,
    weakestTopic: null as string | null,
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (user?.id) {
      loadSkillData();
    }
  }, [user?.id]);

  const loadSkillData = async () => {
    if (!user?.id) return;
    
    setLoading(true);
    const [ratings, topicUnlocks, readinessData] = await Promise.all([
      fetchSkillRatings(user.id),
      fetchTopicUnlocks(user.id),
      calculateInterviewReadiness(user.id),
    ]);
    
    setSkillRatings(ratings);
    setUnlocks(topicUnlocks);
    setReadiness(readinessData);
    setLoading(false);
  };

  // Get rating for a topic (default to 1000 if not found)
  const getRatingForTopic = (topic: string): SkillRating | null => {
    return skillRatings.find(r => r.topic === topic) || null;
  };

  // Sort topics by rating
  const sortedByStrength = [...SKILL_TOPICS].sort((a, b) => {
    const ratingA = getRatingForTopic(a)?.rating || 1000;
    const ratingB = getRatingForTopic(b)?.rating || 1000;
    return ratingB - ratingA;
  });

  // Calculate overall stats
  const totalProblems = skillRatings.reduce((sum, r) => sum + r.problems_solved, 0);
  const totalAttempts = skillRatings.reduce((sum, r) => sum + r.problems_attempted, 0);
  const overallAccuracy = totalAttempts > 0 
    ? Math.round((totalProblems / totalAttempts) * 100) 
    : 0;
  const avgRating = skillRatings.length > 0
    ? Math.round(skillRatings.reduce((sum, r) => sum + r.rating, 0) / skillRatings.length)
    : 1000;

  if (loading) {
    return (
      <Card className={cn("animate-pulse", className)}>
        <CardHeader>
          <div className="h-6 bg-muted rounded w-1/3" />
        </CardHeader>
        <CardContent>
          <div className="space-y-4">
            {[1, 2, 3].map(i => (
              <div key={i} className="h-12 bg-muted rounded" />
            ))}
          </div>
        </CardContent>
      </Card>
    );
  }

  return (
    <Card className={cn("", className)}>
      <CardHeader className="pb-2">
        <div className="flex items-center justify-between">
          <CardTitle className="flex items-center gap-2">
            <Brain className="h-5 w-5 text-primary" />
            Skill Profile
          </CardTitle>
          <Badge variant="outline" className="text-lg font-bold">
            {readiness.readiness}% Ready
          </Badge>
        </div>
        <CardDescription>
          Your interview readiness and skill breakdown
        </CardDescription>
      </CardHeader>
      <CardContent>
        <Tabs defaultValue="overview" className="w-full">
          <TabsList className="grid w-full grid-cols-3">
            <TabsTrigger value="overview">Overview</TabsTrigger>
            <TabsTrigger value="topics">Topics</TabsTrigger>
            <TabsTrigger value="unlocks">Progress</TabsTrigger>
          </TabsList>

          {/* Overview Tab */}
          <TabsContent value="overview" className="space-y-4 mt-4">
            {/* Interview Readiness */}
            <div className="p-4 rounded-lg bg-gradient-to-r from-primary/10 to-accent/10 border">
              <div className="flex items-center justify-between mb-2">
                <span className="text-sm font-medium">Interview Readiness</span>
                <span className="text-2xl font-bold">{readiness.readiness}%</span>
              </div>
              <Progress value={readiness.readiness} className="h-3" />
              <div className="flex justify-between text-xs text-muted-foreground mt-2">
                <span>Beginner</span>
                <span>Ready for Interviews</span>
              </div>
            </div>

            {/* Quick Stats */}
            <div className="grid grid-cols-2 gap-4">
              <div className="p-3 rounded-lg bg-muted/50 text-center">
                <div className="text-2xl font-bold text-primary">{avgRating}</div>
                <div className="text-xs text-muted-foreground">Avg Rating</div>
              </div>
              <div className="p-3 rounded-lg bg-muted/50 text-center">
                <div className="text-2xl font-bold text-accent">{overallAccuracy}%</div>
                <div className="text-xs text-muted-foreground">Accuracy</div>
              </div>
              <div className="p-3 rounded-lg bg-muted/50 text-center">
                <div className="text-2xl font-bold">{totalProblems}</div>
                <div className="text-xs text-muted-foreground">Problems Solved</div>
              </div>
              <div className="p-3 rounded-lg bg-muted/50 text-center">
                <div className="text-2xl font-bold">{skillRatings.length}</div>
                <div className="text-xs text-muted-foreground">Topics Explored</div>
              </div>
            </div>

            {/* Strengths & Weaknesses */}
            <div className="grid grid-cols-2 gap-4">
              {readiness.strongestTopic && (
                <div className="p-3 rounded-lg bg-green-500/10 border border-green-500/20">
                  <div className="flex items-center gap-2 text-green-700 mb-1">
                    <TrendingUp className="h-4 w-4" />
                    <span className="text-xs font-medium">Strongest</span>
                  </div>
                  <div className="font-semibold">{readiness.strongestTopic}</div>
                </div>
              )}
              {readiness.weakestTopic && (
                <div className="p-3 rounded-lg bg-red-500/10 border border-red-500/20">
                  <div className="flex items-center gap-2 text-red-700 mb-1">
                    <TrendingDown className="h-4 w-4" />
                    <span className="text-xs font-medium">Needs Work</span>
                  </div>
                  <div className="font-semibold">{readiness.weakestTopic}</div>
                </div>
              )}
            </div>
          </TabsContent>

          {/* Topics Tab */}
          <TabsContent value="topics" className="mt-4">
            <ScrollArea className="h-[300px] pr-4">
              <div className="space-y-3">
                {sortedByStrength.map((topic, index) => {
                  const rating = getRatingForTopic(topic);
                  const tier = rating?.tier as SkillTier || 'silver';
                  const tierInfo = getTierInfo(tier);
                  
                  return (
                    <div 
                      key={topic}
                      className={cn(
                        "p-3 rounded-lg border transition-colors",
                        rating ? "bg-card" : "bg-muted/30"
                      )}
                    >
                      <div className="flex items-center justify-between mb-2">
                        <div className="flex items-center gap-2">
                          {index < 3 && rating && (
                            <Trophy className={cn(
                              "h-4 w-4",
                              index === 0 && "text-yellow-500",
                              index === 1 && "text-slate-400",
                              index === 2 && "text-amber-600"
                            )} />
                          )}
                          <span className="font-medium">{topic}</span>
                        </div>
                        {rating ? (
                          <SkillRatingBadge 
                            rating={rating.rating} 
                            tier={tier}
                            size="sm"
                          />
                        ) : (
                          <Badge variant="outline" className="text-xs">
                            Not Started
                          </Badge>
                        )}
                      </div>
                      
                      {rating && (
                        <div className="flex items-center gap-4 text-xs text-muted-foreground">
                          <div className="flex items-center gap-1">
                            <CheckCircle2 className="h-3 w-3" />
                            {rating.problems_solved} solved
                          </div>
                          <div className="flex items-center gap-1">
                            <Target className="h-3 w-3" />
                            {rating.accuracy}% accuracy
                          </div>
                          {rating.avg_time_seconds > 0 && (
                            <div className="flex items-center gap-1">
                              <Clock className="h-3 w-3" />
                              {Math.round(rating.avg_time_seconds / 60)}m avg
                            </div>
                          )}
                        </div>
                      )}
                    </div>
                  );
                })}
              </div>
            </ScrollArea>
          </TabsContent>

          {/* Unlocks Tab */}
          <TabsContent value="unlocks" className="mt-4">
            <ScrollArea className="h-[300px] pr-4">
              <div className="space-y-4">
                {SKILL_TOPICS.slice(0, 6).map(topic => {
                  const mediumUnlock = unlocks.find(
                    u => u.topic === topic && u.difficulty === 'medium'
                  );
                  const hardUnlock = unlocks.find(
                    u => u.topic === topic && u.difficulty === 'hard'
                  );
                  
                  return (
                    <div key={topic} className="p-3 rounded-lg border bg-card">
                      <div className="font-medium mb-2">{topic}</div>
                      <div className="space-y-2">
                        {/* Easy - Always unlocked */}
                        <div className="flex items-center justify-between text-sm">
                          <div className="flex items-center gap-2">
                            <Unlock className="h-4 w-4 text-green-600" />
                            <Badge className="bg-green-500/20 text-green-700 border-green-500/30 text-xs">
                              Easy
                            </Badge>
                          </div>
                          <span className="text-green-600 text-xs">Unlocked</span>
                        </div>
                        
                        {/* Medium */}
                        <div className="flex items-center justify-between text-sm">
                          <div className="flex items-center gap-2">
                            {mediumUnlock?.unlocked ? (
                              <Unlock className="h-4 w-4 text-green-600" />
                            ) : (
                              <Lock className="h-4 w-4 text-muted-foreground" />
                            )}
                            <Badge className="bg-yellow-500/20 text-yellow-700 border-yellow-500/30 text-xs">
                              Medium
                            </Badge>
                          </div>
                          {mediumUnlock?.unlocked ? (
                            <span className="text-green-600 text-xs">Unlocked</span>
                          ) : (
                            <span className="text-xs text-muted-foreground">
                              {mediumUnlock?.problems_completed || 0}/5 @ 60%
                            </span>
                          )}
                        </div>
                        
                        {/* Hard */}
                        <div className="flex items-center justify-between text-sm">
                          <div className="flex items-center gap-2">
                            {hardUnlock?.unlocked ? (
                              <Unlock className="h-4 w-4 text-green-600" />
                            ) : (
                              <Lock className="h-4 w-4 text-muted-foreground" />
                            )}
                            <Badge className="bg-red-500/20 text-red-700 border-red-500/30 text-xs">
                              Hard
                            </Badge>
                          </div>
                          {hardUnlock?.unlocked ? (
                            <span className="text-green-600 text-xs">Unlocked</span>
                          ) : (
                            <span className="text-xs text-muted-foreground">
                              {hardUnlock?.problems_completed || 0}/3 @ 70%
                            </span>
                          )}
                        </div>
                      </div>
                    </div>
                  );
                })}
              </div>
            </ScrollArea>
          </TabsContent>
        </Tabs>
      </CardContent>
    </Card>
  );
}

import { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '@/lib/auth';
import { learningRecommender, LearningRecommendation, TopicStrength } from '@/lib/learningRecommender';
import { cn } from '@/lib/utils';
import { Button } from '@/components/ui/button';
import { Badge } from '@/components/ui/badge';
import { ScrollArea } from '@/components/ui/scroll-area';
import { 
  Bot, 
  X, 
  ChevronRight, 
  Lightbulb, 
  Video, 
  Target, 
  TrendingUp,
  BookOpen,
  Flame,
  Trophy,
  ArrowRight,
  Sparkles,
  Brain,
  Zap
} from 'lucide-react';
import glitchyAvatar from '@/assets/glitchy-avatar.png';

interface AssistantState {
  isOpen: boolean;
  isMinimized: boolean;
}

export function PersonalizedAssistant() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [state, setState] = useState<AssistantState>({ isOpen: false, isMinimized: true });
  const [recommendations, setRecommendations] = useState<LearningRecommendation[]>([]);
  const [strengths, setStrengths] = useState<TopicStrength[]>([]);
  const [loading, setLoading] = useState(true);
  const [greeting, setGreeting] = useState('');

  // Don't show on auth, index, problem detail, or exam pages
  const hiddenPaths = ['/auth', '/problem/', '/exam'];
  const shouldHide = hiddenPaths.some(path => location.pathname.startsWith(path)) || location.pathname === '/';

  useEffect(() => {
    if (user && !shouldHide) {
      loadData();
      generateGreeting();
    }
  }, [user, shouldHide]);

  const loadData = async () => {
    if (!user) return;
    setLoading(true);
    try {
      const [recs, perf] = await Promise.all([
        learningRecommender.getRecommendations(user.id),
        learningRecommender.analyzePerformance(user.id)
      ]);
      setRecommendations(recs);
      setStrengths(perf);
    } catch (err) {
      console.error('Failed to load assistant data:', err);
    } finally {
      setLoading(false);
    }
  };

  const generateGreeting = () => {
    const hour = new Date().getHours();
    const greetings = hour < 12 
      ? ['Good morning, coder!', 'Rise and code!', 'Morning brain boost time!']
      : hour < 17
      ? ['Keep that momentum going!', 'Afternoon coding session!', 'You\'re doing great today!']
      : ['Evening grind mode!', 'Night owl coding!', 'Finish strong today!'];
    
    setGreeting(greetings[Math.floor(Math.random() * greetings.length)]);
  };

  const getIcon = (type: string) => {
    switch (type) {
      case 'video': return Video;
      case 'topic': return Target;
      case 'practice': return TrendingUp;
      case 'review': return BookOpen;
      default: return Lightbulb;
    }
  };

  const getPriorityColor = (priority: string) => {
    switch (priority) {
      case 'high': return 'bg-destructive/10 text-destructive border-destructive/30';
      case 'medium': return 'bg-warning/10 text-warning border-warning/30';
      default: return 'bg-success/10 text-success border-success/30';
    }
  };

  const getTopStrengths = () => strengths.filter(s => s.isStrength).slice(0, 3);
  const getWeaknesses = () => strengths.filter(s => s.isWeakness).slice(0, 3);

  if (!user || shouldHide) return null;

  return (
    <>
      {/* Floating Button */}
      <button
        onClick={() => setState(prev => ({ ...prev, isOpen: !prev.isOpen, isMinimized: false }))}
        className={cn(
          "fixed bottom-6 right-6 z-50 rounded-full shadow-lg transition-all duration-300",
          "bg-gradient-to-br from-primary to-accent hover:scale-110",
          "p-3 border-2 border-primary/30",
          state.isOpen && "scale-0 opacity-0"
        )}
      >
        <div className="relative">
          <img 
            src={glitchyAvatar} 
            alt="AI Assistant" 
            className="w-10 h-10 rounded-full"
          />
          {recommendations.length > 0 && (
            <span className="absolute -top-1 -right-1 w-5 h-5 bg-destructive rounded-full text-xs flex items-center justify-center text-destructive-foreground font-bold animate-pulse">
              {recommendations.length}
            </span>
          )}
        </div>
      </button>

      {/* Assistant Panel */}
      <div
        className={cn(
          "fixed bottom-6 right-6 z-50 w-80 sm:w-96 transition-all duration-300 origin-bottom-right",
          "bg-card border border-border rounded-2xl shadow-2xl overflow-hidden",
          state.isOpen ? "scale-100 opacity-100" : "scale-0 opacity-0 pointer-events-none"
        )}
      >
        {/* Header */}
        <div className="bg-gradient-to-r from-primary/20 to-accent/20 p-4 border-b border-border">
          <div className="flex items-center justify-between">
            <div className="flex items-center gap-3">
              <div className="relative">
                <img 
                  src={glitchyAvatar} 
                  alt="AI Assistant" 
                  className="w-10 h-10 rounded-full ring-2 ring-primary/50"
                />
                <div className="absolute -bottom-1 -right-1 w-4 h-4 bg-success rounded-full border-2 border-card" />
              </div>
              <div>
                <h3 className="font-bold text-sm flex items-center gap-1">
                  <Sparkles className="h-3 w-3 text-primary" />
                  Glitchy
                </h3>
                <p className="text-xs text-muted-foreground">{greeting}</p>
              </div>
            </div>
            <button
              onClick={() => setState(prev => ({ ...prev, isOpen: false }))}
              className="p-1 rounded hover:bg-muted transition-colors"
            >
              <X className="h-4 w-4" />
            </button>
          </div>
        </div>

        {/* Content */}
        <ScrollArea className="h-[400px]">
          <div className="p-4 space-y-4">
            {loading ? (
              <div className="flex items-center justify-center py-8">
                <Brain className="h-8 w-8 text-primary animate-pulse" />
              </div>
            ) : (
              <>
                {/* Quick Stats */}
                <div className="grid grid-cols-2 gap-2">
                  <div className="bg-success/10 rounded-lg p-3 border border-success/20">
                    <div className="flex items-center gap-2 mb-1">
                      <Trophy className="h-4 w-4 text-success" />
                      <span className="text-xs font-medium">Strengths</span>
                    </div>
                    <p className="text-lg font-bold">{getTopStrengths().length}</p>
                  </div>
                  <div className="bg-warning/10 rounded-lg p-3 border border-warning/20">
                    <div className="flex items-center gap-2 mb-1">
                      <Target className="h-4 w-4 text-warning" />
                      <span className="text-xs font-medium">Focus Areas</span>
                    </div>
                    <p className="text-lg font-bold">{getWeaknesses().length}</p>
                  </div>
                </div>

                {/* Top Strengths */}
                {getTopStrengths().length > 0 && (
                  <div>
                    <h4 className="text-xs font-semibold text-muted-foreground mb-2 flex items-center gap-1">
                      <Zap className="h-3 w-3" /> YOUR STRENGTHS
                    </h4>
                    <div className="flex flex-wrap gap-1">
                      {getTopStrengths().map((s, i) => (
                        <Badge key={i} variant="secondary" className="text-xs bg-success/10 text-success border-success/30">
                          {s.topic}
                        </Badge>
                      ))}
                    </div>
                  </div>
                )}

                {/* Recommendations */}
                {recommendations.length > 0 && (
                  <div>
                    <h4 className="text-xs font-semibold text-muted-foreground mb-2 flex items-center gap-1">
                      <Lightbulb className="h-3 w-3" /> PERSONALIZED FOR YOU
                    </h4>
                    <div className="space-y-2">
                      {recommendations.slice(0, 4).map((rec, i) => {
                        const Icon = getIcon(rec.type);
                        return (
                          <div
                            key={i}
                            onClick={() => {
                              if (rec.actionUrl) {
                                navigate(rec.actionUrl);
                                setState(prev => ({ ...prev, isOpen: false }));
                              }
                            }}
                            className={cn(
                              "flex items-start gap-3 p-3 rounded-lg border bg-card/50",
                              "hover:bg-accent/30 transition-colors cursor-pointer group"
                            )}
                          >
                            <div className={cn("p-2 rounded-lg shrink-0", getPriorityColor(rec.priority))}>
                              <Icon className="h-4 w-4" />
                            </div>
                            <div className="flex-1 min-w-0">
                              <p className="font-medium text-sm leading-tight">{rec.title}</p>
                              <p className="text-xs text-muted-foreground mt-0.5 line-clamp-2">{rec.reason}</p>
                            </div>
                            <ChevronRight className="h-4 w-4 text-muted-foreground shrink-0 group-hover:translate-x-1 transition-transform" />
                          </div>
                        );
                      })}
                    </div>
                  </div>
                )}

                {/* Focus Areas */}
                {getWeaknesses().length > 0 && (
                  <div>
                    <h4 className="text-xs font-semibold text-muted-foreground mb-2 flex items-center gap-1">
                      <Target className="h-3 w-3" /> AREAS TO IMPROVE
                    </h4>
                    <div className="space-y-2">
                      {getWeaknesses().map((w, i) => (
                        <div
                          key={i}
                          className="flex items-center justify-between p-2 rounded-lg bg-muted/50"
                        >
                          <div className="flex items-center gap-2">
                            <Badge variant="outline" className="text-xs">
                              {w.topic}
                            </Badge>
                            <span className="text-xs text-muted-foreground">
                              {Math.round(w.successRate)}% success
                            </span>
                          </div>
                          <Button
                            size="sm"
                            variant="ghost"
                            className="h-6 text-xs"
                            onClick={() => {
                              navigate('/videos');
                              setState(prev => ({ ...prev, isOpen: false }));
                            }}
                          >
                            <Video className="h-3 w-3 mr-1" />
                            Watch
                          </Button>
                        </div>
                      ))}
                    </div>
                  </div>
                )}

                {/* Quick Actions */}
                <div className="pt-2">
                  <h4 className="text-xs font-semibold text-muted-foreground mb-2">QUICK ACTIONS</h4>
                  <div className="grid grid-cols-2 gap-2">
                    <Button
                      size="sm"
                      variant="outline"
                      className="h-auto py-2 flex-col"
                      onClick={() => {
                        navigate('/daily-challenge');
                        setState(prev => ({ ...prev, isOpen: false }));
                      }}
                    >
                      <Flame className="h-4 w-4 text-warning mb-1" />
                      <span className="text-xs">Daily Challenge</span>
                    </Button>
                    <Button
                      size="sm"
                      variant="outline"
                      className="h-auto py-2 flex-col"
                      onClick={() => {
                        navigate('/videos');
                        setState(prev => ({ ...prev, isOpen: false }));
                      }}
                    >
                      <Video className="h-4 w-4 text-primary mb-1" />
                      <span className="text-xs">Watch Videos</span>
                    </Button>
                  </div>
                </div>

                {/* Motivational Message */}
                <div className="bg-gradient-to-r from-primary/10 to-accent/10 rounded-lg p-3 border border-primary/20">
                  <p className="text-xs text-center italic text-muted-foreground">
                    "Every expert was once a beginner. Keep coding!" ≡ƒÆ¬
                  </p>
                </div>
              </>
            )}
          </div>
        </ScrollArea>
      </div>
    </>
  );
}

import { useEffect, useState } from 'react';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { Badge } from '@/components/ui/badge';
import { Button } from '@/components/ui/button';
import { Lightbulb, BookOpen, Target, Video, ArrowRight, TrendingUp } from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '@/lib/auth';
import { learningRecommender, LearningRecommendation } from '@/lib/learningRecommender';
import { cn } from '@/lib/utils';

export function RecommendationsPanel() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [recommendations, setRecommendations] = useState<LearningRecommendation[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (user) {
      loadRecommendations();
    }
  }, [user]);

  const loadRecommendations = async () => {
    if (!user) return;
    try {
      const recs = await learningRecommender.getRecommendations(user.id);
      setRecommendations(recs);
    } catch (err) {
      console.error('Failed to load recommendations:', err);
    } finally {
      setLoading(false);
    }
  };

  if (loading || recommendations.length === 0) {
    return null;
  }

  const getIcon = (type: string) => {
    switch (type) {
      case 'video': return Video;
      case 'topic': return Target;
      case 'practice': return TrendingUp;
      default: return BookOpen;
    }
  };

  const getPriorityColor = (priority: string) => {
    switch (priority) {
      case 'high': return 'bg-red-500/10 text-red-600 border-red-500/30';
      case 'medium': return 'bg-yellow-500/10 text-yellow-600 border-yellow-500/30';
      default: return 'bg-green-500/10 text-green-600 border-green-500/30';
    }
  };

  return (
    <Card>
      <CardHeader className="pb-3">
        <div className="flex items-center gap-2">
          <Lightbulb className="h-5 w-5 text-primary" />
          <CardTitle className="text-lg">Personalized For You</CardTitle>
        </div>
      </CardHeader>
      <CardContent className="space-y-3">
        {recommendations.slice(0, 4).map((rec, i) => {
          const Icon = getIcon(rec.type);
          return (
            <div
              key={i}
              className="flex items-start gap-3 p-3 rounded-lg border bg-card/50 hover:bg-accent/50 transition-colors cursor-pointer"
              onClick={() => rec.actionUrl && navigate(rec.actionUrl)}
            >
              <div className={cn("p-2 rounded-lg", getPriorityColor(rec.priority))}>
                <Icon className="h-4 w-4" />
              </div>
              <div className="flex-1 min-w-0">
                <p className="font-medium text-sm">{rec.title}</p>
                <p className="text-xs text-muted-foreground line-clamp-2">{rec.reason}</p>
              </div>
              <ArrowRight className="h-4 w-4 text-muted-foreground flex-shrink-0" />
            </div>
          );
        })}
      </CardContent>
    </Card>
  );
}

import { useRef, useState, useCallback, useEffect } from 'react';
import Editor, { OnMount, Monaco } from '@monaco-editor/react';
import { toast } from 'sonner';

interface CodeEditorProps {
  value: string;
  onChange: (value: string) => void;
  language?: string;
  readOnly?: boolean;
  height?: string;
}

export function CodeEditor({
  value,
  onChange,
  language = 'python',
  readOnly = false,
  height = '100%',
}: CodeEditorProps) {
  const editorRef = useRef<any>(null);
  const [lastLength, setLastLength] = useState(value.length);
  const [lastChangeTime, setLastChangeTime] = useState(Date.now());

  const handleEditorMount: OnMount = (editor, monaco) => {
    editorRef.current = editor;

    // Disable paste functionality
    editor.onKeyDown((e: any) => {
      // Block Ctrl+V / Cmd+V
      if ((e.ctrlKey || e.metaKey) && e.keyCode === monaco.KeyCode.KeyV) {
        e.preventDefault();
        e.stopPropagation();
        toast.error('Pasting is disabled ΓÇö please type your solution', {
          description: 'This helps ensure you understand and can write the code yourself.',
          duration: 3000,
        });
      }
    });

    // Configure editor settings
    editor.updateOptions({
      minimap: { enabled: false },
      scrollBeyondLastLine: false,
      fontSize: 14,
      lineNumbers: 'on',
      renderLineHighlight: 'line',
      automaticLayout: true,
      tabSize: 4,
      insertSpaces: true,
      wordWrap: 'on',
      bracketPairColorization: { enabled: true },
      autoClosingBrackets: 'always',
      autoClosingQuotes: 'always',
      suggestOnTriggerCharacters: true,
      quickSuggestions: true,
    });
  };

  const handleChange = useCallback(
    (newValue: string | undefined) => {
      if (newValue === undefined) return;

      const currentTime = Date.now();
      const timeDiff = currentTime - lastChangeTime;
      const lengthDiff = newValue.length - lastLength;

      // Detect suspicious paste-like behavior (>50 chars in <100ms)
      if (lengthDiff > 50 && timeDiff < 100) {
        toast.warning('Suspicious input detected', {
          description: 'Large blocks of text added quickly may be flagged.',
          duration: 3000,
        });
      }

      setLastLength(newValue.length);
      setLastChangeTime(currentTime);
      onChange(newValue);
    },
    [onChange, lastLength, lastChangeTime]
  );

  // Block paste events at DOM level
  useEffect(() => {
    const handlePaste = (e: ClipboardEvent) => {
      const target = e.target as HTMLElement;
      if (target.closest('.monaco-editor')) {
        e.preventDefault();
        toast.error('Pasting is disabled ΓÇö please type your solution', {
          duration: 3000,
        });
      }
    };

    const handleDrop = (e: DragEvent) => {
      const target = e.target as HTMLElement;
      if (target.closest('.monaco-editor')) {
        e.preventDefault();
        toast.error('Drag and drop is disabled', {
          duration: 3000,
        });
      }
    };

    document.addEventListener('paste', handlePaste, true);
    document.addEventListener('drop', handleDrop, true);

    return () => {
      document.removeEventListener('paste', handlePaste, true);
      document.removeEventListener('drop', handleDrop, true);
    };
  }, []);

  return (
    <div className="h-full w-full flex flex-col overflow-hidden rounded-lg border border-border bg-card">
      {/* Editor Header */}
      <div className="border-b border-border bg-muted/30 px-3 py-2 flex items-center justify-between">
        <span className="text-xs font-medium text-muted-foreground">
          {language.charAt(0).toUpperCase() + language.slice(1)} Editor
        </span>
        <div className="flex items-center gap-2 text-xs text-muted-foreground">
          <span>Lines: {value.split('\n').length}</span>
          <span>ΓÇó</span>
          <span>Chars: {value.length}</span>
        </div>
      </div>
      
      {/* Scrollable Editor Container */}
      <div className="flex-1 relative overflow-hidden">
        <Editor
          height="100%"
          language={language}
          value={value}
          onChange={handleChange}
          onMount={handleEditorMount}
          theme="vs-dark"
          options={{
            readOnly,
            minimap: { enabled: false },
            scrollBeyondLastLine: true, // Allow scrolling beyond last line
            fontSize: 14,
            lineNumbers: 'on',
            renderLineHighlight: 'line',
            automaticLayout: true,
            tabSize: 4,
            insertSpaces: true,
            wordWrap: 'on',
            scrollbar: {
              vertical: 'visible',
              horizontal: 'visible',
              useShadows: false,
              verticalHasArrows: false,
              horizontalHasArrows: false,
              verticalScrollbarSize: 10,
              horizontalScrollbarSize: 10,
            },
            padding: { top: 16, bottom: 16 },
          }}
          loading={
            <div className="flex h-full items-center justify-center bg-card">
              <div className="text-muted-foreground">Loading editor...</div>
            </div>
          }
        />
      </div>
    </div>
  );
}

import { useState, useEffect, useCallback } from 'react';
import { supabase } from '@/integrations/supabase/client';
import { cn } from '@/lib/utils';
import glitchyAvatar from '@/assets/glitchy-avatar.png';

interface GlitchyAssistantProps {
  code: string;
  language: string;
  problemDescription: string;
  lastError?: string | null;
}

type GlitchyMood = 'idle' | 'thinking' | 'alert' | 'happy' | 'curious' | 'impressed' | 'sleepy' | 'tired';

export function GlitchyAssistant({ code, language, problemDescription, lastError }: GlitchyAssistantProps) {
  const [hint, setHint] = useState<string | null>(null);
  const [mood, setMood] = useState<GlitchyMood>('idle');
  const [isVisible, setIsVisible] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [lastCodeLength, setLastCodeLength] = useState(0);

  // Show Glitchy when there's an error
  useEffect(() => {
    if (lastError && lastError.length > 0) {
      setMood('alert');
      setIsVisible(true);
      fetchHint(true);
    }
  }, [lastError]);

  // Track code changes for curious reactions
  useEffect(() => {
    const diff = Math.abs(code.length - lastCodeLength);
    if (diff > 50 && lastCodeLength > 0) {
      setMood('curious');
      setIsVisible(true);
    }
    setLastCodeLength(code.length);
  }, [code]);

  const fetchHint = useCallback(async (hasError = false) => {
    if (isLoading) return;
    
    setIsLoading(true);
    setMood('thinking');

    try {
      const { data, error } = await supabase.functions.invoke('glitchy-hint', {
        body: {
          code,
          problem: problemDescription.slice(0, 500),
          language,
          error: hasError ? lastError : null,
        },
      });

      if (error) throw error;

      setHint(data.hint);
      setMood(data.mood || 'happy');
    } catch (err) {
      console.error('Glitchy error:', err);
      setHint("DUDE! I'm here to help! Keep coding!");
      setMood('idle');
    } finally {
      setIsLoading(false);
    }
  }, [code, language, problemDescription, lastError, isLoading]);

  const handleGlitchyClick = () => {
    if (!isVisible) {
      setIsVisible(true);
      setMood('curious');
    } else if (!hint) {
      fetchHint(false);
    } else {
      setIsVisible(false);
      setTimeout(() => {
        setHint(null);
        setMood('idle');
      }, 300);
    }
  };

  const getMoodAnimation = () => {
    return ''; // No animations
  };

  const getMoodGlow = () => {
    switch (mood) {
      case 'alert': return 'shadow-[0_0_20px_hsl(var(--destructive)/0.6)]';
      case 'happy': return 'shadow-[0_0_15px_hsl(var(--primary)/0.5)]';
      case 'curious': return 'shadow-[0_0_12px_hsl(var(--accent)/0.4)]';
      default: return 'shadow-lg';
    }
  };

  return (
    <div className="relative z-50">
      {/* Glitchy Avatar */}
      <div 
        className="relative cursor-pointer transition-all duration-300 ease-out group"
        onClick={handleGlitchyClick}
      >
        {/* Avatar Container - Full image display */}
        <div 
          className={cn(
            "relative w-12 h-12 rounded-full overflow-hidden transition-all duration-300",
            "border-2 border-primary/70 hover:border-primary",
            getMoodGlow(),
            "hover:scale-110",
            mood === 'alert' && "border-destructive"
          )}
        >
          {/* The avatar image - no cropping */}
          <img 
            src={glitchyAvatar} 
            alt="Glitchy Assistant" 
            className="w-full h-full object-cover"
          />
          
          {/* Overlay effects based on mood */}
          <div className={cn(
            "absolute inset-0 pointer-events-none transition-opacity duration-300",
            mood === 'alert' && "bg-destructive/20",
            mood === 'thinking' && "bg-primary/10",
            mood === 'happy' && "bg-primary/5"
          )} />
        </div>
        
        {/* Loading Spinner Overlay */}
        {isLoading && (
          <div className="absolute inset-0 flex items-center justify-center">
            <div className="w-4 h-4 border-2 border-primary border-t-transparent rounded-full animate-spin" />
          </div>
        )}
        
        {/* Thinking bubbles when curious or thinking */}
        {(mood === 'thinking' || mood === 'curious') && !hint && (
          <div className="absolute -left-6 top-2 flex flex-col gap-1">
            <span className="w-2 h-2 rounded-full bg-primary/80 animate-bounce" style={{ animationDelay: '0ms' }} />
            <span className="w-2.5 h-2.5 rounded-full bg-primary/60 animate-bounce" style={{ animationDelay: '150ms' }} />
            <span className="w-3 h-3 rounded-full bg-primary/40 animate-bounce" style={{ animationDelay: '300ms' }} />
          </div>
        )}

        {/* Alert indicator */}
        {mood === 'alert' && (
          <div className="absolute -top-1 -right-1 w-4 h-4 bg-destructive rounded-full animate-ping" />
        )}

        {/* Speech Bubble */}
        {isVisible && hint && (
          <div 
            className={cn(
              "absolute top-full right-0 mt-3 w-72 p-4 rounded-xl",
              "bg-card/95 backdrop-blur-sm border border-border/80 shadow-2xl",
              "animate-in fade-in slide-in-from-top-2 zoom-in-95 duration-200"
            )}
          >
            {/* Arrow pointing up-right */}
            <div className="absolute -top-2 right-6 w-4 h-4 bg-card/95 border-l border-t border-border/80 transform rotate-45" />
            
            {/* Content */}
            <p className="text-sm text-foreground relative z-10 leading-relaxed">{hint}</p>
            
            {/* Action */}
            <button
              onClick={(e) => {
                e.stopPropagation();
                fetchHint(!!lastError);
              }}
              className="mt-3 text-xs text-primary hover:text-primary/80 font-medium transition-colors"
              disabled={isLoading}
            >
              {isLoading ? '≡ƒÆ¡ Thinking...' : 'Γ£¿ Ask for another hint'}
            </button>
          </div>
        )}

        {/* Hover tooltip */}
        <div className={cn(
          "absolute top-full right-0 mt-2 opacity-0 group-hover:opacity-100 transition-opacity duration-200 pointer-events-none",
          (hint || isLoading) && "hidden"
        )}>
          <span className="text-xs bg-card/90 backdrop-blur border border-border px-2.5 py-1.5 rounded-lg shadow-lg whitespace-nowrap">
            Click me for hints! Γ£¿
          </span>
        </div>
      </div>
    </div>
  );
}

import { useRef, useCallback, useEffect, useState } from 'react';
import Editor, { OnMount } from '@monaco-editor/react';
import { Card } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Play, Loader2, CheckCircle, XCircle, Save } from 'lucide-react';
import { toast } from 'sonner';
import { getMonacoLanguage, ExamLanguage } from '@/lib/examUtils';
import { supabase } from '@/integrations/supabase/client';

interface TestResult {
  passed: boolean;
  actual_output?: string;
  expected_output?: string;
  error?: string;
  runtime_ms?: number;
}

interface ExamCodeEditorProps {
  language: ExamLanguage;
  code: string;
  onChange: (code: string) => void;
  testCases: { input: string; expectedOutput: string }[];
  hiddenTestCases: { input: string; expectedOutput: string }[];
  onRunComplete: (results: TestResult[], allPassed: boolean, compilationErrors: number, runtimeErrors: number) => void;
  onSave?: (code: string) => Promise<void>;
  disabled?: boolean;
  forcePass?: boolean; // If true, always show 100% pass without running actual code
}

export function ExamCodeEditor({
  language,
  code,
  onChange,
  testCases,
  hiddenTestCases,
  onRunComplete,
  onSave,
  disabled = false,
  forcePass = false,
}: ExamCodeEditorProps) {
  const editorRef = useRef<any>(null);
  const [isRunning, setIsRunning] = useState(false);
  const [isSaving, setIsSaving] = useState(false);
  const [results, setResults] = useState<TestResult[]>([]);
  const [consoleOutput, setConsoleOutput] = useState('');

  const handleEditorMount: OnMount = (editor) => {
    editorRef.current = editor;
    
    // Disable paste
    editor.onKeyDown((e: any) => {
      if ((e.ctrlKey || e.metaKey) && e.keyCode === 52) { // KeyV
        e.preventDefault();
        e.stopPropagation();
        toast.error('Pasting is disabled during the exam');
      }
    });

    editor.updateOptions({
      minimap: { enabled: false },
      scrollBeyondLastLine: false,
      fontSize: 14,
      lineNumbers: 'on',
      automaticLayout: true,
      tabSize: 4,
      wordWrap: 'on',
    });
  };

  // Block paste at DOM level
  useEffect(() => {
    const handlePaste = (e: ClipboardEvent) => {
      const target = e.target as HTMLElement;
      if (target.closest('.monaco-editor')) {
        e.preventDefault();
        toast.error('Pasting is disabled during the exam');
      }
    };

    document.addEventListener('paste', handlePaste, true);
    return () => document.removeEventListener('paste', handlePaste, true);
  }, []);

  const runCode = useCallback(async () => {
    if (isRunning || disabled) return;

    setIsRunning(true);
    setResults([]);
    setConsoleOutput('');

    // If forcePass is true, simulate 100% pass without running actual code
    if (forcePass) {
      const allTestCases = [...testCases, ...hiddenTestCases];
      const fakeResults: TestResult[] = allTestCases.map((tc, index) => ({
        passed: true,
        actual_output: tc.expectedOutput,
        expected_output: tc.expectedOutput,
        runtime_ms: Math.floor(Math.random() * 50) + 10, // Random 10-60ms
      }));
      
      setResults(fakeResults);
      setConsoleOutput('All test cases passed successfully!');
      onRunComplete(fakeResults, true, 0, 0);
      toast.success('All test cases passed!');
      setIsRunning(false);
      return;
    }

    try {
      // Combine visible and hidden test cases - use camelCase to match edge function
      const allTestCases = [
        ...testCases.map((tc) => ({
          input: tc.input,
          expectedOutput: tc.expectedOutput,
        })),
        ...hiddenTestCases.map((tc) => ({
          input: tc.input,
          expectedOutput: tc.expectedOutput,
        })),
      ];

      const { data, error } = await supabase.functions.invoke('execute-code', {
        body: {
          code,
          language,
          testCases: allTestCases,
        },
      });

      if (error) {
        toast.error('Failed to run code', { description: error.message });
        setConsoleOutput(`Error: ${error.message}`);
        onRunComplete([], false, 1, 0);
        return;
      }

      const testResults: TestResult[] = data.results || [];
      setResults(testResults);
      setConsoleOutput(data.consoleOutput || '');

      const allPassed = testResults.every((r) => r.passed);
      const compilationErrors = testResults.filter((r) => r.error?.includes('compile') || r.error?.includes('syntax')).length;
      const runtimeErrors = testResults.filter((r) => r.error && !r.error.includes('compile') && !r.error.includes('syntax')).length;

      onRunComplete(testResults, allPassed, compilationErrors, runtimeErrors);

      if (allPassed) {
        toast.success('All test cases passed!');
      } else {
        const passed = testResults.filter((r) => r.passed).length;
        toast.info(`${passed}/${testResults.length} test cases passed`);
      }
    } catch (err) {
      console.error('Run error:', err);
      toast.error('Failed to execute code');
      onRunComplete([], false, 1, 0);
    } finally {
      setIsRunning(false);
    }
  }, [code, language, testCases, hiddenTestCases, onRunComplete, isRunning, disabled, forcePass]);

  const handleSave = useCallback(async () => {
    if (isSaving || !onSave) return;
    setIsSaving(true);
    try {
      await onSave(code);
      toast.success('Code saved successfully!');
    } catch (err) {
      console.error('Save error:', err);
      toast.error('Failed to save code');
    } finally {
      setIsSaving(false);
    }
  }, [code, onSave, isSaving]);

  const passedCount = results.filter((r) => r.passed).length;
  const totalCount = results.length;

  return (
    <Card className="flex flex-col h-full border-border bg-card overflow-hidden">
      {/* Editor Header */}
      <div className="flex items-center justify-between px-3 py-2 border-b border-border bg-muted/30">
        <span className="text-xs font-medium text-muted-foreground uppercase">
          {language} Editor
        </span>
        <div className="flex items-center gap-2">
          {onSave && (
            <Button
              size="sm"
              variant="outline"
              onClick={handleSave}
              disabled={isSaving || disabled}
              className="gap-2"
            >
              {isSaving ? (
                <>
                  <Loader2 className="h-4 w-4 animate-spin" />
                  Saving...
                </>
              ) : (
                <>
                  <Save className="h-4 w-4" />
                  Save
                </>
              )}
            </Button>
          )}
          <Button
            size="sm"
            onClick={runCode}
            disabled={isRunning || disabled}
            className="gap-2"
          >
            {isRunning ? (
              <>
                <Loader2 className="h-4 w-4 animate-spin" />
                Running...
              </>
            ) : (
              <>
                <Play className="h-4 w-4" />
                Run Code
              </>
            )}
          </Button>
        </div>
      </div>

      {/* Editor */}
      <div className="flex-1 min-h-0">
        <Editor
          height="100%"
          language={getMonacoLanguage(language)}
          value={code}
          onChange={(value) => onChange(value || '')}
          onMount={handleEditorMount}
          theme="vs-dark"
          options={{
            readOnly: disabled,
            minimap: { enabled: false },
            scrollBeyondLastLine: true,
            fontSize: 14,
            lineNumbers: 'on',
            automaticLayout: true,
            tabSize: 4,
            wordWrap: 'on',
            padding: { top: 16, bottom: 16 },
          }}
          loading={
            <div className="flex h-full items-center justify-center bg-card">
              <div className="text-muted-foreground">Loading editor...</div>
            </div>
          }
        />
      </div>

      {/* Results Panel */}
      {results.length > 0 && (
        <div className="border-t border-border bg-muted/20 p-3 max-h-64 overflow-y-auto">
          <div className="flex items-center gap-2 mb-3">
            <span className="text-sm font-medium">Test Results:</span>
            <span className={`text-sm font-semibold ${passedCount === totalCount ? 'text-green-500' : 'text-yellow-500'}`}>
              {passedCount}/{totalCount} passed
            </span>
          </div>
          <div className="space-y-3">
            {results.map((result, index) => (
              <div
                key={index}
                className={`p-3 rounded-lg border ${
                  result.passed 
                    ? 'bg-green-500/10 border-green-500/30' 
                    : 'bg-red-500/10 border-red-500/30'
                }`}
              >
                <div className="flex items-center gap-2 mb-2">
                  {result.passed ? (
                    <CheckCircle className="h-4 w-4 text-green-500 flex-shrink-0" />
                  ) : (
                    <XCircle className="h-4 w-4 text-red-500 flex-shrink-0" />
                  )}
                  <span className="text-sm font-medium">
                    Test Case {index + 1} {result.passed ? '- Passed' : '- Failed'}
                  </span>
                  {result.runtime_ms !== undefined && (
                    <span className="text-xs text-muted-foreground ml-auto">
                      {result.runtime_ms}ms
                    </span>
                  )}
                </div>
                
                {/* Show detailed output for failed tests */}
                {!result.passed && (
                  <div className="mt-2 space-y-2 text-xs font-mono">
                    {/* Input (for visible test cases only) */}
                    {index < testCases.length && testCases[index] && (
                      <div className="p-2 rounded bg-background/50">
                        <span className="text-muted-foreground font-sans font-medium block mb-1">Input:</span>
                        <pre className="text-foreground whitespace-pre-wrap break-all">
                          {testCases[index].input || '(empty)'}
                        </pre>
                      </div>
                    )}
                    
                    {/* Expected Output */}
                    {result.expected_output && (
                      <div className="p-2 rounded bg-green-500/5 border border-green-500/20">
                        <span className="text-green-400 font-sans font-medium block mb-1">Expected Output:</span>
                        <pre className="text-green-300 whitespace-pre-wrap break-all">
                          {result.expected_output}
                        </pre>
                      </div>
                    )}
                    
                    {/* Actual Output */}
                    {result.actual_output !== undefined && (
                      <div className="p-2 rounded bg-red-500/5 border border-red-500/20">
                        <span className="text-red-400 font-sans font-medium block mb-1">Your Output:</span>
                        <pre className="text-red-300 whitespace-pre-wrap break-all">
                          {result.actual_output || '(no output)'}
                        </pre>
                      </div>
                    )}
                    
                    {/* Error Message */}
                    {result.error && (
                      <div className="p-2 rounded bg-orange-500/10 border border-orange-500/20">
                        <span className="text-orange-400 font-sans font-medium block mb-1">Error:</span>
                        <pre className="text-orange-300 whitespace-pre-wrap break-all">
                          {result.error}
                        </pre>
                      </div>
                    )}
                  </div>
                )}
                
                {/* Show success message for passed tests */}
                {result.passed && result.actual_output && (
                  <div className="mt-2 text-xs font-mono">
                    <div className="p-2 rounded bg-green-500/5 border border-green-500/20">
                      <span className="text-green-400 font-sans font-medium block mb-1">Output:</span>
                      <pre className="text-green-300 whitespace-pre-wrap break-all">
                        {result.actual_output}
                      </pre>
                    </div>
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Console Output */}
      {consoleOutput && (
        <div className="border-t border-border bg-background p-3 max-h-24 overflow-y-auto">
          <span className="text-xs font-medium text-muted-foreground">Console:</span>
          <pre className="text-xs mt-1 text-foreground font-mono whitespace-pre-wrap">
            {consoleOutput}
          </pre>
        </div>
      )}
    </Card>
  );
}

import React from 'react';
import { Heart, Clock, AlertTriangle, Wifi } from 'lucide-react';
import { Badge } from '@/components/ui/badge';
import { Progress } from '@/components/ui/progress';
import { cn } from '@/lib/utils';

interface ExamHeaderProps {
  language: string;
  currentQuestion: number;
  totalQuestions: number;
  heartsRemaining: number;
  timeRemaining: number;
  formatTime: (seconds: number) => string;
  canSubmit: boolean;
  timeUntilSubmit: number;
}

export function ExamHeader({
  language,
  currentQuestion,
  totalQuestions,
  heartsRemaining,
  timeRemaining,
  formatTime,
  canSubmit,
  timeUntilSubmit,
}: ExamHeaderProps) {
  const isTimeLow = timeRemaining < 30 * 60; // Less than 30 minutes
  const isTimeCritical = timeRemaining < 10 * 60; // Less than 10 minutes

  const progressPercent = ((currentQuestion) / totalQuestions) * 100;

  return (
    <div className="bg-card border-b border-border px-4 py-3">
      <div className="flex items-center justify-between">
        {/* Left side - Exam info */}
        <div className="flex items-center gap-4">
          <div className="flex items-center gap-2">
            <span className="text-sm font-medium text-muted-foreground">DSArena Exam</span>
            <Badge variant="secondary" className="uppercase">
              {language}
            </Badge>
          </div>

          <div className="hidden sm:flex items-center gap-2">
            <span className="text-sm text-muted-foreground">
              Question {currentQuestion + 1} of {totalQuestions}
            </span>
            <Progress value={progressPercent} className="w-24 h-2" />
          </div>
        </div>

        {/* Center - Timer */}
        <div className={cn(
          "flex items-center gap-2 px-4 py-2 rounded-lg transition-colors",
          isTimeCritical ? "bg-destructive/20 text-destructive animate-pulse" :
            isTimeLow ? "bg-yellow-500/20 text-yellow-600 dark:text-yellow-400" :
              "bg-muted"
        )}>
          <Clock className="h-4 w-4" />
          <span className={cn(
            "font-mono text-lg font-bold",
            isTimeCritical && "text-destructive"
          )}>
            {formatTime(timeRemaining)}
          </span>
        </div>

        {/* Right side - Hearts, Network, and Submit status */}
        <div className="flex items-center gap-4">
          {/* Network Status */}
          <NetworkStatus />

