import { useEffect, useCallback, useRef, useState } from 'react';
import { toast } from 'sonner';

interface UseExamSecurityProps {
  isActive: boolean;
  heartsRemaining: number;
  onViolation: (type: string) => void;
  onDisqualify: () => void;
  onAbandon?: () => void;
  onAutoSubmit?: () => void;
}

const GRACE_PERIOD_MS = 10 * 1000;

export function useExamSecurity({
  isActive,
  heartsRemaining,
  onViolation,
  onDisqualify,
  onAbandon,
  onAutoSubmit,
}: UseExamSecurityProps) {
  const [isFullscreen, setIsFullscreen] = useState(false);

  // Use ref to track current hearts
  const heartsRef = useRef(heartsRemaining);
  useEffect(() => {
    heartsRef.current = heartsRemaining;
  }, [heartsRemaining]);

  // Grace period tracking
  const focusLossTimerRef = useRef<NodeJS.Timeout | null>(null);
  const isFocusLostRef = useRef(false);
  const pendingViolationTypeRef = useRef<string | null>(null);
  const [warning, setWarning] = useState<{ isOpen: boolean; message: string; endTime: number | null }>({
    isOpen: false,
    message: '',
    endTime: null,
  });

  const clearGracePeriodTimer = useCallback(() => {
    if (focusLossTimerRef.current) {
      clearTimeout(focusLossTimerRef.current);
      focusLossTimerRef.current = null;
    }
    isFocusLostRef.current = false;
    pendingViolationTypeRef.current = null;
    setWarning({ isOpen: false, message: '', endTime: null });
  }, []);

  const enterFullscreen = useCallback(async () => {
    try {
      const elem = document.documentElement;
      if (elem.requestFullscreen) {
        await elem.requestFullscreen();
      } else if ((elem as any).webkitRequestFullscreen) {
        await (elem as any).webkitRequestFullscreen();
      } else if ((elem as any).msRequestFullscreen) {
        await (elem as any).msRequestFullscreen();
      }
      setIsFullscreen(true);
      return true;
    } catch (error) {
      console.error('Failed to enter fullscreen:', error);
      toast.error('Please enable fullscreen mode to continue the exam');
      return false;
    }
  }, []);

  const exitFullscreen = useCallback(() => {
    try {
      if (document.exitFullscreen) {
        document.exitFullscreen().catch((err) => {
          console.warn('Exit fullscreen failed:', err);
        });
      } else if ((document as any).webkitExitFullscreen) {
        (document as any).webkitExitFullscreen();
      }
    } catch (err) {
      console.warn('Exit fullscreen error:', err);
    }
    setIsFullscreen(false);
  }, []);

  const triggerGracePeriod = useCallback((violationType: string, message: string) => {
    if (isFocusLostRef.current) return;

    isFocusLostRef.current = true;
    pendingViolationTypeRef.current = violationType;

    setWarning({
      isOpen: true,
      message: message,
      endTime: Date.now() + GRACE_PERIOD_MS
    });

    focusLossTimerRef.current = setTimeout(() => {
      // If timer executes, it means user didn't return in time
      if (isFocusLostRef.current) {
        console.warn('[EXAM SECURITY] 10-second warning expired - eliminating all lives & auto-submitting');
        if (onAbandon) {
          onAbandon();
        } else if (onAutoSubmit) {
          onAutoSubmit();
        }
      }
      clearGracePeriodTimer();
    }, GRACE_PERIOD_MS);
  }, [onViolation, onAbandon, onAutoSubmit, clearGracePeriodTimer]);

  const handleSafeStateReturn = useCallback(() => {
    const isSafe = !!document.fullscreenElement && !document.hidden;
    if (isFocusLostRef.current && isSafe) {
      clearGracePeriodTimer();
    }
  }, [clearGracePeriodTimer]);

  // Sync Fullscreen State & Listener
  useEffect(() => {
    if (!isActive) return;

    const handleFullscreenChange = () => {
      const isNowFullscreen = !!document.fullscreenElement;
      setIsFullscreen(isNowFullscreen);

      if (!isNowFullscreen && heartsRef.current > 0) {
        triggerGracePeriod('fullscreen_exit', 'Please return to fullscreen within 10 seconds or a life will be eliminated.');
      } else if (isNowFullscreen) {
        handleSafeStateReturn();
      }
    };

    document.addEventListener('fullscreenchange', handleFullscreenChange);
    document.addEventListener('webkitfullscreenchange', handleFullscreenChange);

    // Initial check when becoming active
    if (!!document.fullscreenElement) {
      setIsFullscreen(true);
    } else {
      // If we are active but NOT in fullscreen, that's immediate violation?
      // No, let's allow the user a moment or assume enterFullscreen was called.
      // But if they manually exited during "loading", we should know.
      // Let's just sync state.
      setIsFullscreen(false);
    }

    return () => {
      document.removeEventListener('fullscreenchange', handleFullscreenChange);
      document.removeEventListener('webkitfullscreenchange', handleFullscreenChange);
    };
  }, [isActive, triggerGracePeriod, handleSafeStateReturn]);

  // Visibility (Exact original logic)
  useEffect(() => {
    if (!isActive) return;

    const handleVisibilityChange = () => {
      if (document.hidden && heartsRef.current > 0) {
        triggerGracePeriod('tab_switch', 'Please return to the exam tab within 10 seconds or a life will be eliminated.');
      } else if (!document.hidden) {
        handleSafeStateReturn();
      }
    };

    document.addEventListener('visibilitychange', handleVisibilityChange);

    return () => {
      document.removeEventListener('visibilitychange', handleVisibilityChange);
    };
  }, [isActive, triggerGracePeriod, handleSafeStateReturn]);

  // Blur (Exact original logic)
  useEffect(() => {
    if (!isActive) return;

    const handleBlur = () => {
      if (heartsRef.current > 0 && !document.hidden && !!document.fullscreenElement) {
        triggerGracePeriod('window_blur', 'Please keep the exam window focused.');
      }
    };

    const handleFocus = () => {
      handleSafeStateReturn();
    };

    window.addEventListener('blur', handleBlur);
    window.addEventListener('focus', handleFocus);

    return () => {
      window.removeEventListener('blur', handleBlur);
      window.removeEventListener('focus', handleFocus);
    };
  }, [isActive, triggerGracePeriod, handleSafeStateReturn]);

  // Copy/Paste (Exact original logic)
  useEffect(() => {
    if (!isActive) return;
    // ... (keep short for brevity in thought, but full in file)
    const handleCopy = (e: ClipboardEvent) => { e.preventDefault(); onViolation('copy'); toast.warning('Copying is disabled'); };
    const handlePaste = (e: ClipboardEvent) => { e.preventDefault(); onViolation('paste'); toast.warning('Pasting is disabled'); };
    const handleContextMenu = (e: MouseEvent) => { e.preventDefault(); toast.warning('Right-click is disabled'); };
    const handleKeyDown = (e: KeyboardEvent) => {
      if (e.ctrlKey || e.metaKey) {
        if (['c', 'v', 'x'].includes(e.key.toLowerCase())) { e.preventDefault(); toast.warning('Shortcuts disabled'); }
        if (e.key.toLowerCase() === 'r') { e.preventDefault(); toast.warning('Refresh disabled'); }
      }
      if (e.key === 'F5') { e.preventDefault(); toast.warning('Refresh disabled'); }
    };
    const handlePopState = (e: PopStateEvent) => { e.preventDefault(); window.history.pushState(null, '', window.location.href); toast.warning('Back nav disabled'); };

    window.history.pushState(null, '', window.location.href);

    document.addEventListener('copy', handleCopy);
    document.addEventListener('paste', handlePaste);
    document.addEventListener('contextmenu', handleContextMenu);
    document.addEventListener('keydown', handleKeyDown);
    window.addEventListener('popstate', handlePopState);

    return () => {
      document.removeEventListener('copy', handleCopy);
      document.removeEventListener('paste', handlePaste);
      document.removeEventListener('contextmenu', handleContextMenu);
      document.removeEventListener('keydown', handleKeyDown);
      window.removeEventListener('popstate', handlePopState);
    };
  }, [isActive, onViolation]);

  useEffect(() => {
    if (!isActive) return;
    const handleBeforeUnload = (e: BeforeUnloadEvent) => {
      e.preventDefault(); e.returnValue = 'Exam in progress'; return e.returnValue;
    };
    window.addEventListener('beforeunload', handleBeforeUnload);
    return () => window.removeEventListener('beforeunload', handleBeforeUnload);
  }, [isActive]);

  useEffect(() => {
    if (heartsRemaining <= 0 && isActive) {
      onDisqualify();
    }
  }, [heartsRemaining, isActive, onDisqualify]);

  useEffect(() => {
    if (!isActive) clearGracePeriodTimer();
    return () => clearGracePeriodTimer();
  }, [isActive, clearGracePeriodTimer]);

  return { isFullscreen, enterFullscreen, exitFullscreen, warning };
}

import { useState, useEffect, useCallback, useRef } from 'react';

interface UseExamTimerProps {
  totalSeconds: number;
  onTimeUp: () => void;
  isActive: boolean;
}

export function useExamTimer({ totalSeconds, onTimeUp, isActive }: UseExamTimerProps) {
  const [timeRemaining, setTimeRemaining] = useState(totalSeconds);
  const [timeSpent, setTimeSpent] = useState(0);
  const startTimeRef = useRef<number | null>(null);
  const intervalRef = useRef<NodeJS.Timeout | null>(null);

  // Two hours in seconds (when submit becomes enabled)
  const TWO_HOURS = 2 * 60 * 60; // 7200 seconds
  
  const canSubmit = timeSpent >= TWO_HOURS;

  const startTimer = useCallback(() => {
    if (startTimeRef.current === null) {
      startTimeRef.current = Date.now();
    }
  }, []);

  const pauseTimer = useCallback(() => {
    if (intervalRef.current) {
      clearInterval(intervalRef.current);
      intervalRef.current = null;
    }
  }, []);

  const resumeTimer = useCallback(() => {
    if (startTimeRef.current === null) {
      startTimeRef.current = Date.now() - (timeSpent * 1000);
    }
  }, [timeSpent]);

  useEffect(() => {
    if (!isActive) {
      pauseTimer();
      return;
    }

    startTimer();

    intervalRef.current = setInterval(() => {
      setTimeRemaining((prev) => {
        if (prev <= 1) {
          pauseTimer();
          onTimeUp();
          return 0;
        }
        return prev - 1;
      });
      
      setTimeSpent((prev) => prev + 1);
    }, 1000);

    return () => {
      if (intervalRef.current) {
        clearInterval(intervalRef.current);
      }
    };
  }, [isActive, startTimer, pauseTimer, onTimeUp]);

  const formatTime = useCallback((seconds: number) => {
    const hours = Math.floor(seconds / 3600);
    const minutes = Math.floor((seconds % 3600) / 60);
    const secs = seconds % 60;
    
    return `${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  }, []);

  const getTimeUntilSubmit = useCallback(() => {
    const remaining = TWO_HOURS - timeSpent;
    return remaining > 0 ? remaining : 0;
  }, [timeSpent]);

  return {
    timeRemaining,
    timeSpent,
    canSubmit,
    formatTime,
    getTimeUntilSubmit,
    pauseTimer,
    resumeTimer,
  };
}

import { createContext, useContext, useEffect, useState, ReactNode } from 'react';
import { User, Session } from '@supabase/supabase-js';
import { supabase } from '@/integrations/supabase/client';
import { clearLivesCache, initializeLivesCache } from '@/lib/livesSystem';
import { clearProgressCache, initializeProgressCache } from '@/lib/progressStorage';
interface AuthContextType {
  user: User | null;
  session: Session | null;
  loading: boolean;
  signUp: (email: string, password: string) => Promise<{ error: Error | null }>;
  signIn: (email: string, password: string) => Promise<{ error: Error | null }>;
  signOut: () => Promise<void>;
  resetPassword: (email: string) => Promise<{ error: Error | null }>;
  updatePassword: (newPassword: string) => Promise<{ error: Error | null }>;
}

const AuthContext = createContext<AuthContextType | undefined>(undefined);

export function AuthProvider({ children }: { children: ReactNode }) {
  const [user, setUser] = useState<User | null>(null);
  const [session, setSession] = useState<Session | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const { data: { subscription } } = supabase.auth.onAuthStateChange(
      (event, session) => {
        setSession(session);
        setUser(session?.user ?? null);
        setLoading(false);

        // Initialize caches on login using setTimeout to avoid deadlock
        if (event === 'SIGNED_IN' && session?.user) {
          setTimeout(() => {
            Promise.all([
              initializeLivesCache(session.user.id),
              initializeProgressCache(session.user.id)
            ]);
          }, 0);
        }

        // Clear caches on logout
        if (event === 'SIGNED_OUT') {
          clearLivesCache();
          clearProgressCache();
        }
      }
    );

    supabase.auth.getSession().then(({ data: { session } }) => {
      setSession(session);
      setUser(session?.user ?? null);
      setLoading(false);
      
      // Initialize caches if user is already logged in
      if (session?.user) {
        setTimeout(() => {
          Promise.all([
            initializeLivesCache(session.user.id),
            initializeProgressCache(session.user.id)
          ]);
        }, 0);
      }
    });

    return () => subscription.unsubscribe();
  }, []);

  const signUp = async (email: string, password: string) => {
    const redirectUrl = `${window.location.origin}/`;
    const { error } = await supabase.auth.signUp({
      email,
      password,
      options: {
        emailRedirectTo: redirectUrl,
      },
    });
    return { error };
  };

  const signIn = async (email: string, password: string) => {
    const { error } = await supabase.auth.signInWithPassword({
      email,
      password,
    });
    return { error };
  };

  const signOut = async () => {
    // Clear caches before signing out
    clearLivesCache();
    clearProgressCache();
    
    await supabase.auth.signOut();
    setUser(null);
    setSession(null);
  };

  const resetPassword = async (email: string) => {
    const redirectUrl = `${window.location.origin}/reset-password`;
    const { error } = await supabase.auth.resetPasswordForEmail(email, {
      redirectTo: redirectUrl,
    });
    return { error };
  };

  const updatePassword = async (newPassword: string) => {
    const { error } = await supabase.auth.updateUser({
      password: newPassword,
    });
    return { error };
  };

  return (
    <AuthContext.Provider value={{ user, session, loading, signUp, signIn, signOut, resetPassword, updatePassword }}>
      {children}
    </AuthContext.Provider>
  );
}

export function useAuth() {
  const context = useContext(AuthContext);
  if (context === undefined) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
}

// Daily Challenge Service - Manages daily coding challenges and user progress (Local Storage Version)
import { problemsData } from './problemsData';

export interface DailyChallenge {
  id: string;
  date: string;
  title: string;
  description: string;
  category: string;
  difficulty: 'easy' | 'medium' | 'hard';
  inputFormat: string;
  outputFormat: string;
  constraints: string;
  timeLimitMs: number;
  memoryLimitMb: number;
  testCases: Array<{
    input: string;
    expectedOutput: string;
    is_visible: boolean;
  }>;
  story?: string;
}

export interface DailyChallengeProgress {
  challengeDate: string;
  isCompleted: boolean;
  solvedAt?: string;
  runtimeMs?: number;
  language?: string;
}

class DailyChallengeService {
  private readonly STORAGE_KEY = 'daily_challenge_progress';
  private readonly STREAK_KEY = 'daily_streak';

  // Get today's challenge - Same for all users
  async getTodayChallenge(): Promise<DailyChallenge> {
    const today = new Date().toISOString().split('T')[0];
    return await this.generateDailyChallenge(today);
  }

  // Generate a daily challenge (on-the-fly, deterministic)
  // NOTE: This system ensures ALL users see the SAME daily challenge for any given date
  // Uses date-based seeding for consistency across all users worldwide
  async generateDailyChallenge(date: string): Promise<DailyChallenge> {
    try {
      // Select a problem based on date (deterministic)
      const availableProblems = problemsData;
      if (!availableProblems || availableProblems.length === 0) {
        throw new Error('No problems available for daily challenge generation');
      }

      // Use date as seed for consistent daily challenge
      const seed = this.getSeedFromDate(date);
      const selectedIndex = seed % availableProblems.length;
      const randomProblem = availableProblems[selectedIndex];

      return {
        id: `${date}-${selectedIndex}`,
        date,
        title: randomProblem.title,
        description: randomProblem.description,
        category: randomProblem.category,
        difficulty: randomProblem.difficulty,
        inputFormat: randomProblem.inputFormat,
        outputFormat: randomProblem.outputFormat,
        constraints: randomProblem.constraints,
        timeLimitMs: randomProblem.timeLimitMs,
        memoryLimitMb: randomProblem.memoryLimitMb,
        testCases: [
          ...randomProblem.visibleTestCases.map(tc => ({
            input: tc.input,
            expectedOutput: tc.expectedOutput,
            is_visible: true
          })),
          ...randomProblem.hiddenTestCases.map(tc => ({
            input: tc.input,
            expectedOutput: tc.expectedOutput,
            is_visible: false
          }))
        ],
        story: randomProblem.story
      };
    } catch (error) {
      console.error('Error generating daily challenge:', error);
      throw new Error('Failed to generate daily challenge');
    }
  }

  // Generate deterministic seed from date
  private getSeedFromDate(date: string): number {
    let seed = 0;
    for (let i = 0; i < date.length; i++) {
      seed = (seed * 31 + date.charCodeAt(i)) >>> 0;
    }
    return seed;
  }

  // Get today's challenge progress
  async getTodayChallengeProgress(): Promise<DailyChallengeProgress | null> {
    const today = new Date().toISOString().split('T')[0];
    return this.getChallengeProgress(today);
  }

  // Get challenge progress from localStorage
  getChallengeProgress(challengeDate: string): DailyChallengeProgress | null {
    try {
      const stored = localStorage.getItem(this.STORAGE_KEY);
      if (!stored) return null;

      const progressData = JSON.parse(stored);
      return progressData[challengeDate] || null;
    } catch (error) {
      console.error('Error reading challenge progress:', error);
      return null;
    }
  }

  // Check if user has solved today's challenge
  async hasUserSolvedToday(): Promise<boolean> {
    const today = new Date().toISOString().split('T')[0];
    const progress = this.getChallengeProgress(today);
    return progress?.isCompleted || false;
  }

  // Update challenge progress and streak
  async updateChallengeProgress(challengeDate: string, progress: Partial<DailyChallengeProgress>): Promise<void> {
    try {
      // Get existing progress data
      const stored = localStorage.getItem(this.STORAGE_KEY);
      const progressData = stored ? JSON.parse(stored) : {};

      // Update progress for this challenge
      const updatedProgress: DailyChallengeProgress = {
        challengeDate,
        isCompleted: progress.isCompleted || false,
        solvedAt: progress.solvedAt,
        runtimeMs: progress.runtimeMs,
        language: progress.language
      };

      progressData[challengeDate] = updatedProgress;
      localStorage.setItem(this.STORAGE_KEY, JSON.stringify(progressData));

      // Update streak if challenge was completed
      if (progress.isCompleted) {
        await this.updateDailyStreak(challengeDate);
      }
    } catch (error) {
      console.error('Error updating challenge progress:', error);
      throw error;
    }
  }

  // Update daily streak
  private async updateDailyStreak(completionDate: string): Promise<void> {
    try {
      const streak = this.calculateStreak(completionDate);
      localStorage.setItem(this.STREAK_KEY, JSON.stringify({ 
        currentStreak: streak, 
        lastUpdated: completionDate 
      }));
    } catch (error) {
      console.error('Error updating streak:', error);
    }
  }

  // Get user's daily streak
  async getUserDailyStreak(): Promise<number> {
    try {
      const stored = localStorage.getItem(this.STREAK_KEY);
      if (!stored) return 0;

      const streakData = JSON.parse(stored);
      return streakData.currentStreak || 0;
    } catch (error) {
      console.error('Error fetching streak:', error);
      return 0;
    }
  }

  // Calculate streak from completion data
  private calculateStreak(latestCompletionDate: string): number {
    const stored = localStorage.getItem(this.STORAGE_KEY);
    if (!stored) return 1;

    const progressData = JSON.parse(stored);
    const completions = Object.values(progressData)
      .filter((p: any) => p.isCompleted)
      .map((p: any) => p.challengeDate)
      .sort((a: string, b: string) => new Date(b).getTime() - new Date(a).getTime());

    if (completions.length === 0) return 1;

    // Calculate consecutive days from the latest completion
    let streak = 1;
    let currentDate = new Date(latestCompletionDate);

    for (let i = 1; i < completions.length; i++) {
      const completionDate = new Date(completions[i]);
      const daysDiff = Math.floor((currentDate.getTime() - completionDate.getTime()) / (1000 * 60 * 60 * 24));
      
      if (daysDiff === 1) {
        streak++;
        currentDate = completionDate;
      } else {
        break;
      }
    }

    return streak;
  }

  // Get user's challenge history
  async getChallengeHistory(limit: number = 30): Promise<DailyChallengeProgress[]> {
    try {
      const stored = localStorage.getItem(this.STORAGE_KEY);
      if (!stored) return [];

      const progressData = JSON.parse(stored);
      const history = Object.values(progressData)
        .sort((a: any, b: any) => new Date(b.challengeDate).getTime() - new Date(a.challengeDate).getTime())
        .slice(0, limit);

      return history as DailyChallengeProgress[];
    } catch (error) {
      console.error('Error fetching challenge history:', error);
      return [];
    }
  }

  // Get available challenges for a date range (for calendar view)
  async getChallengeCalendar(startDate: string, endDate: string): Promise<Array<{
    date: string;
    challenge?: DailyChallenge;
    userCompleted?: boolean;
  }>> {
    try {
      const calendarItems = [];
      const current = new Date(startDate);
      const end = new Date(endDate);

      while (current <= end) {
        const dateStr = current.toISOString().split('T')[0];
        const challenge = await this.generateDailyChallenge(dateStr);
        const progress = this.getChallengeProgress(dateStr);
        
        calendarItems.push({
          date: dateStr,
          challenge,
          userCompleted: progress?.isCompleted || false
        });

        current.setDate(current.getDate() + 1);
      }

      return calendarItems;
    } catch (error) {
      console.error('Error fetching challenge calendar:', error);
      return [];
    }
  }

  // Get daily challenge statistics for the user
  async getUserChallengeStats(): Promise<{
    totalCompleted: number;
    currentStreak: number;
    longestStreak: number;
    averageRuntime: number;
    difficultyBreakdown: {
      easy: number;
      medium: number;
      hard: number;
    };
  }> {
    try {
      const stored = localStorage.getItem(this.STORAGE_KEY);
      if (!stored) {
        return {
          totalCompleted: 0,
          currentStreak: 0,
          longestStreak: 0,
          averageRuntime: 0,
          difficultyBreakdown: { easy: 0, medium: 0, hard: 0 }
        };
      }

      const progressData = JSON.parse(stored);
      const completedChallenges = Object.values(progressData).filter((p: any) => p.isCompleted) as DailyChallengeProgress[];
      
      const totalCompleted = completedChallenges.length;
      const currentStreak = await this.getUserDailyStreak();
      
      // Calculate difficulty breakdown
      const difficultyBreakdown = { easy: 0, medium: 0, hard: 0 };
      let totalRuntime = 0;
      let runtimeCount = 0;

      for (const challenge of completedChallenges) {
        // Get challenge details to determine difficulty
        const challengeData = await this.generateDailyChallenge(challenge.challengeDate);
        const difficulty = challengeData.difficulty;
        
        if (difficultyBreakdown.hasOwnProperty(difficulty)) {
          difficultyBreakdown[difficulty as keyof typeof difficultyBreakdown]++;
        }
        
        if (challenge.runtimeMs) {
          totalRuntime += challenge.runtimeMs;
          runtimeCount++;
        }
      }

      return {
        totalCompleted,
        currentStreak,
        longestStreak: currentStreak, // For now, same as current
        averageRuntime: runtimeCount > 0 ? Math.round(totalRuntime / runtimeCount) : 0,
        difficultyBreakdown
      };
    } catch (error) {
      console.error('Error fetching challenge stats:', error);
      return {
        totalCompleted: 0,
        currentStreak: 0,
        longestStreak: 0,
        averageRuntime: 0,
        difficultyBreakdown: { easy: 0, medium: 0, hard: 0 }
      };
    }
  }

  // Clear all progress data (for testing)
  clearAllProgress(): void {
    localStorage.removeItem(this.STORAGE_KEY);
    localStorage.removeItem(this.STREAK_KEY);
  }
}

