    }

    setIsApprovingAll(true);
    try {
      const { error } = await supabase
        .from('exam_eligibility')
        .update({
          is_eligible: true,
          unblocked_by: user?.id,
          unblocked_at: new Date().toISOString(),
          updated_at: new Date().toISOString(),
        })
