          <Input
            placeholder="Search by name, username or ID..."
            className="pl-10 h-10"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </div>

        <Tabs defaultValue="all">
          <TabsList>
            <TabsTrigger value="all">All Exams ({filteredSessions.length})</TabsTrigger>
            <TabsTrigger value="in_progress">
              In Progress ({filteredInProgressSessions.length})
            </TabsTrigger>
            <TabsTrigger value="failed">
              Failed/Disqualified ({filteredFailedSessions.length})
            </TabsTrigger>
            <TabsTrigger value="blocked">
              Blocked Users ({filteredBlockedUsers.length})
            </TabsTrigger>
          </TabsList>

          <TabsContent value="all">
            <Card>
              <CardHeader>
                <CardTitle>Exam Sessions</CardTitle>
              </CardHeader>
              <CardContent>
                {sessions.length === 0 ? (
                  <p className="text-muted-foreground text-center py-8">No exam sessions found</p>
                ) : (
                  <Table>
                    <TableHeader>
                      <TableRow>
                        <TableHead>User</TableHead>
                        <TableHead>Language</TableHead>
                        <TableHead>Status</TableHead>
                        <TableHead>Result</TableHead>
                        <TableHead>Time</TableHead>
                        <TableHead>Hearts</TableHead>
                        <TableHead>Violations</TableHead>
                        <TableHead>Date</TableHead>
                        <TableHead>Actions</TableHead>
                      </TableRow>
                    </TableHeader>
                    <TableBody>
                      {filteredSessions.map((session) => {
                        const result = getExamResult(session);
                        const isStale = session.status === 'in_progress' && result === 'disqualified';
                        const isInProgress = result === 'in_progress';

                        return (
                          <TableRow key={session.id}>
                            <TableCell className="font-medium">
                              {session.display_name || session.username || session.user_id.slice(0, 8)}
                            </TableCell>
                            <TableCell className="capitalize">{session.language}</TableCell>
                            <TableCell>{getStatusBadge(session)}</TableCell>
                            <TableCell>{getResultBadge(session)}</TableCell>
                            <TableCell>
                              {session.time_spent_seconds ? formatExamTime(session.time_spent_seconds) : '-'}
                            </TableCell>
                            <TableCell>{session.hearts_remaining}/3</TableCell>
                            <TableCell>{session.total_violations}</TableCell>
                            <TableCell className="text-sm text-muted-foreground">
                              {new Date(session.created_at).toLocaleDateString()}
                            </TableCell>
                            <TableCell>
                              <div className="flex items-center gap-2">
                                {isStale && (
                                  <Button
                                    size="sm"
                                    variant="outline"
                                    onClick={() => fixStaleSession(session.id, session.user_id)}
                                  >
                                    Fix Status
                                  </Button>
                                )}
                                {isInProgress && (
                                  <Button
                                    size="sm"
                                    variant="destructive"
                                    onClick={() => revokeExam(session.id, session.user_id)}
                                  >
                                    <Ban className="h-3 w-3 mr-1" />
                                    Revoke
                                  </Button>
                                )}
                                {(result === 'failed' || result === 'disqualified' || result === 'revoked') && (
                                  <Button
                                    size="sm"
                                    variant="secondary"
                                    onClick={() => approveRetakeFromSession(session.user_id)}
                                  >
                                    <RotateCcw className="h-3 w-3 mr-1" />
                                    Allow Retake
                                  </Button>
                                )}
                                <Button
                                  size="sm"
                                  variant="ghost"
                                  className="text-destructive hover:bg-destructive/10"
                                  onClick={() => deleteSingleSession(session.id)}
                                >
                                  <Trash2 className="h-4 w-4" />
                                </Button>
                              </div>
                            </TableCell>
                          </TableRow>
                        );
                      })}
                    </TableBody>
                  </Table>
                )}
              </CardContent>
            </Card>
          </TabsContent>

          <TabsContent value="in_progress">
            <Card>
              <CardHeader>
                <CardTitle className="flex items-center gap-2">
                  <Clock className="h-5 w-5 text-yellow-500" />
                  In Progress Exams
                </CardTitle>
              </CardHeader>
              <CardContent>
                {inProgressSessions.length === 0 ? (
                  <p className="text-muted-foreground text-center py-8">No exams in progress</p>
                ) : (
                  <Table>
                    <TableHeader>
                      <TableRow>
                        <TableHead>User</TableHead>
                        <TableHead>Language</TableHead>
                        <TableHead>Hearts Left</TableHead>
                        <TableHead>Violations</TableHead>
                        <TableHead>Started At</TableHead>
                        <TableHead>Actions</TableHead>
                      </TableRow>
                    </TableHeader>
                    <TableBody>
                      {filteredInProgressSessions.map((session) => (
                        <TableRow key={session.id}>
                          <TableCell className="font-medium">
                            {session.display_name || session.username || session.user_id.slice(0, 8)}
                          </TableCell>
                          <TableCell className="capitalize">{session.language}</TableCell>
                          <TableCell>{session.hearts_remaining}/3</TableCell>
                          <TableCell>{session.total_violations}</TableCell>
                          <TableCell className="text-sm text-muted-foreground">
                            {new Date(session.created_at).toLocaleString()}
                          </TableCell>
                          <TableCell>
                            <div className="flex items-center gap-2">
                              <Button
                                size="sm"
                                variant="destructive"
                                onClick={() => revokeExam(session.id, session.user_id)}
                              >
                                <Ban className="h-4 w-4 mr-2" />
                                Revoke Exam
                              </Button>
                              <Button
                                size="sm"
                                variant="ghost"
                                className="text-destructive hover:bg-destructive/10"
                                onClick={() => deleteSingleSession(session.id)}
                              >
                                <Trash2 className="h-4 w-4" />
                              </Button>
                            </div>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                )}
              </CardContent>
            </Card>
          </TabsContent>

          <TabsContent value="failed">
            <Card>
              <CardHeader>
                <CardTitle className="flex items-center gap-2">
                  <XCircle className="h-5 w-5 text-red-500" />
                  Failed & Disqualified Exams
                </CardTitle>
              </CardHeader>
              <CardContent>
                {failedSessions.length === 0 ? (
                  <p className="text-muted-foreground text-center py-8">No failed exams</p>
                ) : (
                  <Table>
                    <TableHeader>
                      <TableRow>
                        <TableHead>User</TableHead>
                        <TableHead>Language</TableHead>
                        <TableHead>Result</TableHead>
                        <TableHead>Hearts Left</TableHead>
                        <TableHead>Violations</TableHead>
                        <TableHead>Date</TableHead>
                        <TableHead>Actions</TableHead>
                      </TableRow>
                    </TableHeader>
                    <TableBody>
                      {filteredFailedSessions.map((session) => {
                        const result = getExamResult(session);
                        const isStale = session.status === 'in_progress' && result === 'disqualified';

                        return (
                          <TableRow key={session.id}>
                            <TableCell className="font-medium">
                              {session.display_name || session.username || session.user_id.slice(0, 8)}
                            </TableCell>
                            <TableCell className="capitalize">{session.language}</TableCell>
                            <TableCell>{getResultBadge(session)}</TableCell>
                            <TableCell>{session.hearts_remaining}/3</TableCell>
                            <TableCell>{session.total_violations}</TableCell>
                            <TableCell className="text-sm text-muted-foreground">
                              {new Date(session.created_at).toLocaleDateString()}
                            </TableCell>
                            <TableCell>
                              <div className="flex items-center gap-2">
                                {isStale && (
                                  <Button
                                    size="sm"
                                    variant="outline"
                                    onClick={() => fixStaleSession(session.id, session.user_id)}
                                  >
                                    Fix Status
                                  </Button>
                                )}
                                <Button
                                  size="sm"
                                  onClick={() => approveRetakeFromSession(session.user_id)}
                                >
                                  <RotateCcw className="h-4 w-4 mr-2" />
                                  Allow Retake
                                </Button>
                                <Button
                                  size="sm"
                                  variant="ghost"
                                  className="text-destructive hover:bg-destructive/10"
                                  onClick={() => deleteSingleSession(session.id)}
                                >
                                  <Trash2 className="h-4 w-4" />
                                </Button>
                              </div>
                            </TableCell>
                          </TableRow>
                        );
                      })}
                    </TableBody>
                  </Table>
                )}
              </CardContent>
            </Card>
          </TabsContent>

          <TabsContent value="blocked">
            <Card>
              <CardHeader>
                <CardTitle className="flex items-center gap-2">
                  <AlertTriangle className="h-5 w-5 text-yellow-500" />
                  Blocked Users (Awaiting Approval)
                </CardTitle>
              </CardHeader>
              <CardContent>
                {blockedUsers.length === 0 ? (
                  <p className="text-muted-foreground text-center py-8">No blocked users</p>
                ) : (
                  <Table>
                    <TableHeader>
                      <TableRow>
                        <TableHead>User</TableHead>
                        <TableHead>Blocked At</TableHead>
                        <TableHead>Action</TableHead>
                      </TableRow>
                    </TableHeader>
                    <TableBody>
                      {filteredBlockedUsers.map((blocked) => (
                        <TableRow key={blocked.id}>
                          <TableCell className="font-medium">
                            {blocked.display_name || blocked.username || blocked.user_id.slice(0, 8)}
                          </TableCell>
                          <TableCell>
                            {blocked.blocked_at ? new Date(blocked.blocked_at).toLocaleString() : '-'}
                          </TableCell>
                          <TableCell>
                            <div className="flex items-center gap-2">
                              <Button size="sm" onClick={() => approveRetake(blocked.user_id)}>
                                <Unlock className="h-4 w-4 mr-2" />
                                Approve Retake
                              </Button>
                              <Button
                                size="sm"
                                variant="ghost"
                                className="text-destructive hover:bg-destructive/10"
                                onClick={() => deleteEligibilityRecord(blocked.user_id)}
                              >
                                <Trash2 className="h-4 w-4" />
                              </Button>
                            </div>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                )}
              </CardContent>
            </Card>
          </TabsContent>
        </Tabs>
      </div>
    </div>
  );
}

// Practice Problems Page with Problem-Solving Interface
import { useState, useEffect, useCallback } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import { Navbar } from '@/components/layout/Navbar';
import { CodeEditor } from '@/components/editor/CodeEditor';
import { TestCasePanel } from '@/components/problems/TestCasePanel';
import { Button } from '@/components/ui/button';
import { Badge } from '@/components/ui/badge';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { ScrollArea } from '@/components/ui/scroll-area';
import { Separator } from '@/components/ui/separator';
import {
  ResizableHandle,
  ResizablePanel,
  ResizablePanelGroup,
} from '@/components/ui/resizable';
import { useAuth } from '@/lib/auth';
import { 
  practiceProblemsData, 
  getPracticeProblemBySlug,
  PracticeProblemData 
} from '@/lib/practiceProblemsData';
import { supabase } from '@/integrations/supabase/client';
import { toast } from 'sonner';
import {
  Trophy,
  Clock,
  Target,
  Star,
  ArrowRight,
  CheckCircle2,
  XCircle,
  Loader2,
  Home,
  Zap,
  BookOpen,
  Play,
  Send,
  Save,
  ChevronLeft,
  ChevronRight,
  Code,
} from 'lucide-react';
import { cn } from '@/lib/utils';
import confetti from 'canvas-confetti';
import { LanguageSelector } from '@/components/editor/LanguageSelector';

export default function PracticeProblemsPage() {
  const { slug } = useParams<{ slug: string }>();
  const [problem, setProblem] = useState<PracticeProblemData | null>(null);
  const [currentProblemIndex, setCurrentProblemIndex] = useState(0);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [solved, setSolved] = useState(false);

  const [code, setCode] = useState('');
  const [running, setRunning] = useState(false);
  const [submitting, setSubmitting] = useState(false);
  const [results, setResults] = useState<any[] | null>(null);
  const [consoleOutput, setConsoleOutput] = useState('');
  const [showDescription, setShowDescription] = useState(true);
  const [lastError, setLastError] = useState<string | null>(null);
  const [selectedLanguage, setSelectedLanguage] = useState<string>('python');

  const { user } = useAuth();
  const navigate = useNavigate();

  // Helper functions for UI elements
  const getDifficultyColor = (difficulty: string) => {
    // All practice problems are "easy" level
    return 'bg-green-500/20 text-green-700 border-green-500/30';
  };

  const getDifficultyIcon = (difficulty: string) => {
    return <Target className="h-4 w-4" />;
  };

  // Language-specific starter code templates
  const getStarterCodeForLanguage = useCallback((lang: string): string => {
    if (!problem) return '';
    
    const templates: Record<string, string> = {
      python: problem.starterCode,
      javascript: `// JavaScript version of ${problem.title}
// Write your solution here
function solution() {
    // Your code here
}

// Read input from stdin
const readline = require('readline');
const rl = readline.createInterface({
    input: process.stdin,
    output: process.stdout
});

let lines = [];
rl.on('line', (line) => {
    lines.push(line);
});

rl.on('close', () => {
    // Parse input and call solution
    console.log(solution());
});
`,
      java: `// Java version of ${problem.title}
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        // Read input
        
        // Your solution here
        
        // Print output
    }
}
`,
      cpp: `// C++ version of ${problem.title}
#include <iostream>
#include <vector>
#include <string>
using namespace std;

int main() {
    // Read input
    
    // Your solution here
    
    // Print output
    
    return 0;
}
`,
    };
    return templates[lang] || templates.python;
  }, [problem]);

  useEffect(() => {
    loadProblem();
  }, [slug]);

  useEffect(() => {
    // Initialize code when problem and language are loaded
    if (problem && selectedLanguage) {
      const draftKey = `practice-problem-draft-${user?.id || 'anonymous'}-${problem.id}-${selectedLanguage}`;
      const savedDraft = localStorage.getItem(draftKey);
      if (savedDraft) {
        setCode(savedDraft);
      } else {
        setCode(getStarterCodeForLanguage(selectedLanguage));
      }
    }
  }, [problem, selectedLanguage, user?.id, getStarterCodeForLanguage]);

  const loadProblem = async () => {
    try {
      setIsLoading(true);
      setError(null);

      if (slug) {
        // Load specific problem by slug
        const foundProblem = getPracticeProblemBySlug(slug);
        if (foundProblem) {
          setProblem(foundProblem);
          setCurrentProblemIndex(practiceProblemsData.findIndex(p => p.id === foundProblem.id));
        } else {
          setError('Problem not found');
        }
      } else {
        // Load first problem by default
        setProblem(practiceProblemsData[0]);
        setCurrentProblemIndex(0);
      }
    } catch (err) {
      console.error('Failed to load problem:', err);
      setError('Failed to load problem. Please try again.');
    } finally {
      setIsLoading(false);
    }
  };

  const triggerConfetti = () => {
    const duration = 3000;
    const end = Date.now() + duration;

    const frame = () => {
      confetti({
        particleCount: 3,
        angle: 60,
        spread: 55,
        origin: { x: 0, y: 0.8 },
        colors: ['#00D9FF', '#10B981', '#8B5CF6'],
      });
      confetti({
        particleCount: 3,
        angle: 120,
        spread: 55,
        origin: { x: 1, y: 0.8 },
        colors: ['#00D9FF', '#10B981', '#8B5CF6'],
      });

      if (Date.now() < end) {
        requestAnimationFrame(frame);
      }
    };
    frame();
  };

  const saveDraft = useCallback(() => {
    if (!problem) return;
    
    const draftKey = `practice-problem-draft-${user?.id || 'anonymous'}-${problem.id}-${selectedLanguage}`;
    localStorage.setItem(draftKey, code);
    toast.success('Draft saved');
  }, [user, code, problem, selectedLanguage]);

  const runCode = async (submitAll = false) => {
    if (!problem) return;

    if (submitAll) {
      setSubmitting(true);
    } else {
      setRunning(true);
    }
    setResults(null);
    setConsoleOutput('');
    setLastError(null);

    try {
      // Prepare test cases based on submission type
      const testCasesToRun = submitAll 
        ? [...problem.visibleTestCases, ...problem.hiddenTestCases]
        : problem.visibleTestCases;

      const formattedTestCases = testCasesToRun.map(tc => ({
        input: tc.input,
        expectedOutput: tc.expectedOutput,
      }));

      const { data, error } = await supabase.functions.invoke('execute-code', {
        body: { code, testCases: formattedTestCases, language: selectedLanguage }
      });

      if (error) {
        throw new Error(error.message || 'Failed to execute code');
      }

      if (data.error) {
        throw new Error(data.error);
      }

      setResults(data.results);
      setConsoleOutput(data.consoleOutput || '');
      
      // Check for any errors in results
      const errorResult = data.results.find((r: any) => r.error);
      if (errorResult) {
        setLastError(errorResult.error);
      }

      const passedCount = data.results.filter((r: any) => r.passed).length;
      const totalCount = data.results.length;

      if (submitAll) {
        if (passedCount === totalCount) {
          setSolved(true);
          triggerConfetti();
          toast.success(`≡ƒÄë Congratulations! All ${totalCount} test cases passed!`);
        } else {
          toast.error(`${passedCount}/${totalCount} test cases passed`);
        }
      } else {
        if (passedCount === totalCount) {
          toast.success(`All visible test cases passed!`);
        } else {
          toast.info(`${passedCount}/${totalCount} visible test cases passed`);
        }
      }
    } catch (error: unknown) {
      console.error('Execution error:', error);
      const message = error instanceof Error ? error.message : 'An error occurred';
      toast.error(message);
      setConsoleOutput(message);
      setLastError(message);
    } finally {
      setRunning(false);
      setSubmitting(false);
    }
  };

  // Convert test cases to format expected by TestCasePanel
  const testCases = problem?.visibleTestCases.map((tc, index) => ({
    id: `tc-${index}`,
    input: tc.input,
    expected_output: tc.expectedOutput,
    is_visible: true,
    display_order: index,
  })) || [];

  // Navigation functions
  const navigateToProblem = (index: number) => {
    if (index >= 0 && index < practiceProblemsData.length) {
      const problemSlug = practiceProblemsData[index].slug;
      navigate(`/practice-problems/${problemSlug}`);
    }
  };

  if (isLoading) {
    return (
      <div className="flex min-h-screen items-center justify-center bg-background">
        <Loader2 className="h-8 w-8 animate-spin text-primary" />
      </div>
    );
  }

  if (error || !problem) {
    return (
      <div className="min-h-screen bg-background">
        <Navbar />
        <div className="container mx-auto px-4 py-8">
          <div className="max-w-2xl mx-auto text-center">
            <XCircle className="h-12 w-12 mx-auto mb-4 text-destructive" />
            <h1 className="text-2xl font-bold mb-4">Failed to Load Problem</h1>
            <p className="text-muted-foreground mb-6">
              {error || 'Unable to load the practice problem. Please try again.'}
            </p>
            <Button onClick={loadProblem} disabled={isLoading}>
              {isLoading ? <Loader2 className="mr-2 h-4 w-4 animate-spin" /> : null}
              Try Again
            </Button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="flex h-screen flex-col bg-background">
      <Navbar />

      {/* Header */}
      <div className="bg-card border-b border-border px-4 py-3">
        <div className="container mx-auto flex items-center justify-between">
          <div className="flex items-center gap-4">
            <div className="flex items-center gap-2">
              <Code className="h-5 w-5 text-primary" />
              <h1 className="text-lg font-semibold">Practice Problems</h1>
            </div>
            <span className="text-sm text-muted-foreground">
              Problem {currentProblemIndex + 1} of {practiceProblemsData.length}
            </span>
          </div>
          <div className="flex items-center gap-2">
            <Button
              variant="outline"
              size="sm"
              onClick={() => navigateToProblem(currentProblemIndex - 1)}
              disabled={currentProblemIndex === 0}
            >
              <ChevronLeft className="h-4 w-4" />
            </Button>
            <Button
              variant="outline"
              size="sm"
              onClick={() => navigateToProblem(currentProblemIndex + 1)}
              disabled={currentProblemIndex === practiceProblemsData.length - 1}
            >
              <ChevronRight className="h-4 w-4" />
            </Button>
            <Button
              variant="outline"
              size="sm"
              onClick={() => navigate('/practice-problems')}
            >
              All Problems
            </Button>
          </div>
        </div>
      </div>

      <div className="flex-1 overflow-hidden">
        <ResizablePanelGroup direction="horizontal">
          {/* Problem Description Panel */}
          <ResizablePanel
            defaultSize={40}
            minSize={showDescription ? 25 : 0}
            maxSize={showDescription ? 60 : 0}
            className={cn(!showDescription && 'hidden')}
          >
            <div className="flex h-full flex-col">
              {/* Problem Header */}
              <div className="border-b border-border p-4">
                <div className="flex items-start justify-between">
                  <div className="flex-1">
                    <h1 className="text-xl font-bold">{problem.title}</h1>
                    <div className="mt-2 flex items-center gap-2">
                      <Badge variant="outline" className={getDifficultyColor('easy')}>
                        <Target className="h-4 w-4" />
                        <span className="ml-1">Practice</span>
                      </Badge>
                      {solved && (
                        <Badge className="bg-success text-success-foreground">Completed Γ£ô</Badge>
                      )}
                    </div>
                  </div>
                  <Button
                    variant="outline"
                    size="sm"
                    onClick={() => navigate('/')}
                  >
                    <Home className="mr-2 h-4 w-4" />
                    <span className="hidden sm:inline">Home</span>
                  </Button>
                </div>
              </div>

              {/* Problem Content */}
              <ScrollArea className="flex-1">
                <div className="space-y-6 p-4">
                  {/* Problem Description */}
                  <div>
                    <h3 className="mb-2 font-semibold">Problem Description</h3>
                    <div className="prose prose-sm max-w-none">
                      <pre className="whitespace-pre-wrap text-sm">{problem.description}</pre>
                    </div>
                  </div>

                  <Separator />

                  {/* Input/Output Formats */}
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <div>
                      <h4 className="font-semibold mb-2">Input Format</h4>
                      <pre className="rounded-lg bg-muted p-3 text-sm whitespace-pre-wrap">
                        {problem.inputFormat}
                      </pre>
                    </div>
                    <div>
                      <h4 className="font-semibold mb-2">Output Format</h4>
                      <pre className="rounded-lg bg-muted p-3 text-sm whitespace-pre-wrap">
                        {problem.outputFormat}
                      </pre>
                    </div>
                  </div>

                  <Separator />

                  {/* Constraints */}
                  <div>
                    <h4 className="font-semibold mb-2">Constraints</h4>
                    <pre className="rounded-lg bg-muted p-3 text-sm whitespace-pre-wrap">
                      {problem.constraints}
                    </pre>
                  </div>

                  {/* Examples */}
                  <div>
                    <h4 className="font-semibold mb-3">Examples</h4>
                    <div className="space-y-4">
                      {problem.visibleTestCases.map((testCase, index) => (
                        <div
                          key={index}
                          className="rounded-lg border border-border bg-card p-4"
                        >
                          <div className="mb-2 text-sm font-medium text-muted-foreground">
                            Example {index + 1}
                          </div>
                          <div className="space-y-3">
                            <div>
                              <div className="mb-1 text-xs font-medium text-muted-foreground">
                                Input
                              </div>
                              <pre className="rounded bg-muted p-2 font-mono text-sm">
                                {testCase.input}
                              </pre>
                            </div>
                            <div>
                              <div className="mb-1 text-xs font-medium text-muted-foreground">
                                Output
                              </div>
                              <pre className="rounded bg-muted p-2 font-mono text-sm">
                                {testCase.expectedOutput}
                              </pre>
                            </div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              </ScrollArea>
            </div>
          </ResizablePanel>

          <ResizableHandle withHandle />

          {/* Code Editor Panel */}
          <ResizablePanel defaultSize={60} minSize={40}>
            <ResizablePanelGroup direction="vertical">
              {/* Editor */}
              <ResizablePanel defaultSize={60} minSize={30}>
                <div className="flex h-full flex-col">
                  {/* Editor Header */}
                  <div className="flex items-center justify-between border-b border-border px-4 py-2">
                    <div className="flex items-center gap-2">
                      <button
                        onClick={() => setShowDescription(!showDescription)}
                        className="rounded p-1 hover:bg-secondary"
                      >
                        {showDescription ? (
                          <ChevronLeft className="h-4 w-4" />
                        ) : (
                          <ChevronRight className="h-4 w-4" />
                        )}
                      </button>
                      <LanguageSelector
                        value={selectedLanguage}
                        onChange={setSelectedLanguage}
                        disabled={false}
                      />
                    </div>
                  </div>

                  {/* Editor Content */}
                  <div className="flex-1 relative">
                    {solved && (
                      <div className="absolute inset-0 z-10 bg-background/80 backdrop-blur-sm flex items-center justify-center">
                        <div className="text-center">
                          <CheckCircle2 className="h-12 w-12 text-success mx-auto mb-3" />
                          <p className="text-lg font-semibold text-success">Problem Solved!</p>
                          <p className="text-sm text-muted-foreground mt-1">Great job! Try the next problem.</p>
                        </div>
                      </div>
                    )}
                    <CodeEditor
                      value={code}
                      onChange={setCode}
                      language={selectedLanguage}
                    />
                  </div>

                  {/* Editor Footer */}
                  <div className="flex items-center justify-between border-t border-border px-4 py-3">
                    <span className="text-xs text-muted-foreground">
                      {solved ? "Problem completed" : "Paste disabled ΓÇö type your solution"}
                    </span>
                    <div className="flex gap-2">
                      {solved ? (
                        <div className="flex items-center gap-2 text-sm text-success">
                          <CheckCircle2 className="h-4 w-4" />
                          <span>Completed</span>
                        </div>
                      ) : (
                        <>
                          <Button
                            variant="outline"
                            onClick={saveDraft}
                            size="sm"
                          >
                            <Save className="mr-2 h-4 w-4" />
                            Save
                          </Button>
                          <Button
                            variant="outline"
                            onClick={() => runCode(false)}
                            disabled={running || submitting}
                          >
                            {running ? (
                              <Loader2 className="mr-2 h-4 w-4 animate-spin" />
                            ) : (
                              <Play className="mr-2 h-4 w-4" />
                            )}
                            Run
                          </Button>
                          <Button
                            variant="default"
                            onClick={() => runCode(true)}
                            disabled={running || submitting}
                            className="bg-primary hover:bg-primary/90"
                          >
                            {submitting ? (
                              <Loader2 className="mr-2 h-4 w-4 animate-spin" />
                            ) : (
                              <Send className="mr-2 h-4 w-4" />
                            )}
                            Submit
                          </Button>
                        </>
                      )}
                    </div>
                  </div>
                </div>
              </ResizablePanel>

              <ResizableHandle withHandle />

              {/* Test Results Panel */}
              <ResizablePanel defaultSize={40} minSize={20}>
                <TestCasePanel
                  testCases={testCases}
                  results={results || undefined}
                  isRunning={running || submitting}
                  consoleOutput={consoleOutput}
                />
              </ResizablePanel>
            </ResizablePanelGroup>
          </ResizablePanel>
        </ResizablePanelGroup>
      </div>
    </div>
  );
}

import { useState, useEffect, useMemo } from 'react';
import { useNavigate } from 'react-router-dom';
import { Navbar } from '@/components/layout/Navbar';
import { ProblemCard } from '@/components/problems/ProblemCard';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Badge } from '@/components/ui/badge';
import {
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
} from '@/components/ui/select';
import {
  Collapsible,
  CollapsibleContent,
  CollapsibleTrigger,
} from '@/components/ui/collapsible';
import { problemsData, topicsData } from '@/lib/problemsData';
import { useAuth } from '@/lib/auth';
import { fetchSolvedProblems } from '@/lib/progressStorage';
import { Search, Home, ChevronDown, ChevronRight, Hash, ArrowLeftRight, Layers, GitBranch, Calculator, RotateCcw, Network, BarChart3, TrendingUp, Zap, Calendar, Binary } from 'lucide-react';

// Icon mapping for categories
const categoryIcons: Record<string, React.ReactNode> = {
  "Arrays and Hashing": <Hash className="h-4 w-4" />,
  "Two Pointers": <ArrowLeftRight className="h-4 w-4" />,
  "Sliding Window": <Layers className="h-4 w-4" />,
  "Stacks": <Layers className="h-4 w-4" />,
  "Binary Search": <Search className="h-4 w-4" />,
  "Linked List": <GitBranch className="h-4 w-4" />,
  "Trees": <GitBranch className="h-4 w-4" />,
  "Maths and Geometry": <Calculator className="h-4 w-4" />,
  "Backtracking": <RotateCcw className="h-4 w-4" />,
  "Graphs": <Network className="h-4 w-4" />,
  "Priority Queues & Heaps": <BarChart3 className="h-4 w-4" />,
  "Tries": <GitBranch className="h-4 w-4" />,
  "Advanced Graph": <Network className="h-4 w-4" />,
  "1D Dynamic Programming": <TrendingUp className="h-4 w-4" />,
  "2D Dynamic Programming": <TrendingUp className="h-4 w-4" />,
  "Greedy": <Zap className="h-4 w-4" />,
  "Intervals": <Calendar className="h-4 w-4" />,
  "Bit Manipulation": <Binary className="h-4 w-4" />,
};

export default function Problems() {
  const navigate = useNavigate();
  const [solvedIds, setSolvedIds] = useState<Set<string>>(new Set());
  const [search, setSearch] = useState('');
  const [selectedTopic, setSelectedTopic] = useState<string>('all');
  const [selectedDifficulty, setSelectedDifficulty] = useState<string>('all');
  const [openCategories, setOpenCategories] = useState<Set<string>>(new Set());
  const { user } = useAuth();

  useEffect(() => {
    if (user) {
      loadSolvedProblems();
    }
  }, [user]);

  // Open all categories by default on mount
  useEffect(() => {
    const categories = [...new Set(problemsData.map(p => p.category))];
    setOpenCategories(new Set(categories));
  }, []);

  const loadSolvedProblems = async () => {
    if (!user) return;
    const solved = await fetchSolvedProblems(user.id);
    setSolvedIds(solved);
  };

  const filteredProblems = problemsData.filter((problem) => {
    const matchesSearch = problem.title.toLowerCase().includes(search.toLowerCase());
    const matchesTopic =
      selectedTopic === 'all' || problem.category === selectedTopic;
    const matchesDifficulty =
      selectedDifficulty === 'all' || problem.difficulty === selectedDifficulty;
    return matchesSearch && matchesTopic && matchesDifficulty;
  });

  // Group problems by category
  const problemsByCategory = useMemo(() => {
    const grouped: Record<string, typeof filteredProblems> = {};
    filteredProblems.forEach(problem => {
      if (!grouped[problem.category]) {
        grouped[problem.category] = [];
      }
      grouped[problem.category].push(problem);
    });
    return grouped;
  }, [filteredProblems]);

  // Sort categories based on topicsData order
  const sortedCategories = useMemo(() => {
    const categoryOrder = topicsData.reduce((acc, topic, index) => {
      acc[topic.name] = topic.displayOrder || index;
      return acc;
    }, {} as Record<string, number>);
    
    return Object.keys(problemsByCategory).sort((a, b) => {
      return (categoryOrder[a] || 999) - (categoryOrder[b] || 999);
    });
  }, [problemsByCategory]);

  const problemCounts = {
    total: problemsData.length,
    easy: problemsData.filter((p) => p.difficulty === 'easy').length,
    medium: problemsData.filter((p) => p.difficulty === 'medium').length,
    hard: problemsData.filter((p) => p.difficulty === 'hard').length,
  };

  // Get unique categories from problems data
  const categories = [...new Set(problemsData.map(p => p.category))];

  const toggleCategory = (category: string) => {
    setOpenCategories(prev => {
      const newSet = new Set(prev);
      if (newSet.has(category)) {
        newSet.delete(category);
      } else {
        newSet.add(category);
      }
      return newSet;
    });
  };

  const expandAll = () => {
    setOpenCategories(new Set(categories));
  };

  const collapseAll = () => {
    setOpenCategories(new Set());
  };

  // Group problems within a category by difficulty
  const groupByDifficulty = (problems: typeof filteredProblems) => {
    return {
      easy: problems.filter(p => p.difficulty === 'easy'),
      medium: problems.filter(p => p.difficulty === 'medium'),
      hard: problems.filter(p => p.difficulty === 'hard'),
    };
  };

  return (
    <div className="min-h-screen bg-background">
      <Navbar />

      <main className="container mx-auto px-4 py-8">
        {/* Header */}
        <div className="mb-8 flex items-center justify-between">
          <div>
            <h1 className="text-3xl font-bold">DSA Problems</h1>
            <p className="mt-2 text-muted-foreground">
              {problemCounts.total} problems across {categories.length} topics
            </p>
          </div>
          <Button
            variant="outline"
            size="sm"
            onClick={() => navigate('/')}
            className="flex items-center gap-2"
          >
            <Home className="h-4 w-4" />
            <span className="hidden sm:inline">Home</span>
          </Button>
        </div>

        {/* Stats */}
        <div className="mb-8 flex flex-wrap gap-3">
          <Badge variant="outline" className="px-3 py-1">
            {problemCounts.total} Total
          </Badge>
          <Badge variant="outline" className="border-green-500/30 bg-green-500/10 text-green-500 px-3 py-1">
            {problemCounts.easy} Easy
          </Badge>
          <Badge variant="outline" className="border-yellow-500/30 bg-yellow-500/10 text-yellow-500 px-3 py-1">
            {problemCounts.medium} Medium
          </Badge>
          <Badge variant="outline" className="border-red-500/30 bg-red-500/10 text-red-500 px-3 py-1">
            {problemCounts.hard} Hard
          </Badge>
          {user && (
            <Badge variant="outline" className="border-success/30 bg-success/10 text-success px-3 py-1">
              {solvedIds.size} Solved
            </Badge>
          )}
        </div>

        {/* Filters */}
        <div className="mb-6 flex flex-col gap-4 sm:flex-row">
          <div className="relative flex-1">
            <Search className="absolute left-3 top-1/2 h-4 w-4 -translate-y-1/2 text-muted-foreground" />
            <Input
              placeholder="Search problems..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="pl-10"
            />
          </div>
          <Select value={selectedTopic} onValueChange={setSelectedTopic}>
            <SelectTrigger className="w-full sm:w-48">
              <SelectValue placeholder="Topic" />
            </SelectTrigger>
            <SelectContent>
              <SelectItem value="all">All Topics</SelectItem>
              {categories.map((category) => (
                <SelectItem key={category} value={category}>
                  {category}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
          <Select value={selectedDifficulty} onValueChange={setSelectedDifficulty}>
            <SelectTrigger className="w-full sm:w-40">
              <SelectValue placeholder="Difficulty" />
            </SelectTrigger>
            <SelectContent>
              <SelectItem value="all">All Levels</SelectItem>
              <SelectItem value="easy">Easy</SelectItem>
              <SelectItem value="medium">Medium</SelectItem>
              <SelectItem value="hard">Hard</SelectItem>
            </SelectContent>
          </Select>
        </div>

        {/* Expand/Collapse All */}
        <div className="mb-4 flex gap-2">
          <Button variant="ghost" size="sm" onClick={expandAll}>
            Expand All
          </Button>
          <Button variant="ghost" size="sm" onClick={collapseAll}>
            Collapse All
          </Button>
        </div>

        {/* Problems List by Category */}
        {filteredProblems.length === 0 ? (
          <div className="rounded-xl border border-border bg-card p-12 text-center">
            <p className="text-muted-foreground">
              No problems match your filters.
            </p>
          </div>
        ) : (
          <div className="space-y-4">
            {sortedCategories.map((category) => {
              const categoryProblems = problemsByCategory[category];
              const grouped = groupByDifficulty(categoryProblems);
              const isOpen = openCategories.has(category);
              const solvedInCategory = categoryProblems.filter(p => solvedIds.has(p.id)).length;

              return (
                <Collapsible
                  key={category}
                  open={isOpen}
                  onOpenChange={() => toggleCategory(category)}
                >
                  <CollapsibleTrigger asChild>
                    <div className="flex items-center justify-between rounded-lg border border-border bg-card p-4 cursor-pointer hover:bg-accent/50 transition-colors">
                      <div className="flex items-center gap-3">
                        {isOpen ? (
                          <ChevronDown className="h-5 w-5 text-muted-foreground" />
                        ) : (
                          <ChevronRight className="h-5 w-5 text-muted-foreground" />
                        )}
                        <div className="flex items-center gap-2">
                          {categoryIcons[category] || <Hash className="h-4 w-4" />}
                          <span className="font-semibold">{category}</span>
                        </div>
                        <Badge variant="secondary" className="ml-2">
                          {categoryProblems.length} problems
                        </Badge>
                        {user && solvedInCategory > 0 && (
                          <Badge variant="outline" className="border-success/30 bg-success/10 text-success">
                            {solvedInCategory}/{categoryProblems.length} solved
                          </Badge>
                        )}
                      </div>
                      <div className="flex gap-2">
                        <Badge className="bg-green-500/20 text-green-500 border-green-500/30">
                          {grouped.easy.length} Easy
                        </Badge>
                        <Badge className="bg-yellow-500/20 text-yellow-500 border-yellow-500/30">
                          {grouped.medium.length} Medium
                        </Badge>
                        <Badge className="bg-red-500/20 text-red-500 border-red-500/30">
                          {grouped.hard.length} Hard
                        </Badge>
                      </div>
                    </div>
                  </CollapsibleTrigger>
                  <CollapsibleContent>
                    <div className="mt-2 ml-6 space-y-4">
                      {/* Easy Problems */}
                      {grouped.easy.length > 0 && (
                        <div>
                          <h4 className="text-sm font-medium text-green-500 mb-2 flex items-center gap-2">
                            <span className="w-2 h-2 rounded-full bg-green-500" />
                            Easy ({grouped.easy.length})
                          </h4>
                          <div className="space-y-2">
                            {grouped.easy.map((problem) => (
                              <ProblemCard
                                key={problem.id}
                                id={problem.id}
                                title={problem.title}
                                slug={problem.slug}
                                difficulty={problem.difficulty}
                                topic={problem.category}
                                isSolved={solvedIds.has(problem.id)}
                              />
                            ))}
                          </div>
                        </div>
                      )}

                      {/* Medium Problems */}
                      {grouped.medium.length > 0 && (
                        <div>
                          <h4 className="text-sm font-medium text-yellow-500 mb-2 flex items-center gap-2">
                            <span className="w-2 h-2 rounded-full bg-yellow-500" />
                            Medium ({grouped.medium.length})
                          </h4>
                          <div className="space-y-2">
                            {grouped.medium.map((problem) => (
                              <ProblemCard
                                key={problem.id}
                                id={problem.id}
                                title={problem.title}
                                slug={problem.slug}
                                difficulty={problem.difficulty}
                                topic={problem.category}
                                isSolved={solvedIds.has(problem.id)}
                              />
                            ))}
                          </div>
                        </div>
                      )}

                      {/* Hard Problems */}
                      {grouped.hard.length > 0 && (
                        <div>
                          <h4 className="text-sm font-medium text-red-500 mb-2 flex items-center gap-2">
                            <span className="w-2 h-2 rounded-full bg-red-500" />
                            Hard ({grouped.hard.length})
                          </h4>
                          <div className="space-y-2">
                            {grouped.hard.map((problem) => (
                              <ProblemCard
                                key={problem.id}
                                id={problem.id}
                                title={problem.title}
                                slug={problem.slug}
                                difficulty={problem.difficulty}
                                topic={problem.category}
                                isSolved={solvedIds.has(problem.id)}
                              />
                            ))}
                          </div>
                        </div>
                      )}
                    </div>
                  </CollapsibleContent>
                </Collapsible>
              );
            })}
          </div>
        )}
      </main>
    </div>
  );
}

import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Navbar } from '@/components/layout/Navbar';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Label } from '@/components/ui/label';
import { Textarea } from '@/components/ui/textarea';
import { Switch } from '@/components/ui/switch';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { Avatar, AvatarFallback } from '@/components/ui/avatar';
import { supabase } from '@/integrations/supabase/client';
import { useAuth } from '@/lib/auth';
import { toast } from 'sonner';
import { Loader2, Save } from 'lucide-react';

interface Profile {
  username: string | null;
  display_name: string | null;
  bio: string | null;
  is_public: boolean;
}

export default function Profile() {
  const { user, loading: authLoading } = useAuth();
  const navigate = useNavigate();
  const [profile, setProfile] = useState<Profile | null>(null);
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);

  const [username, setUsername] = useState('');
  const [displayName, setDisplayName] = useState('');
  const [bio, setBio] = useState('');
  const [isPublic, setIsPublic] = useState(false);

  useEffect(() => {
    if (!authLoading && !user) {
      navigate('/auth');
    }
  }, [user, authLoading, navigate]);

  useEffect(() => {
    if (user) {
      fetchProfile();
    }
  }, [user]);

  const fetchProfile = async () => {
    if (!user) return;

    const { data, error } = await supabase
      .from('profiles')
      .select('username, display_name, bio, is_public')
      .eq('id', user.id)
      .single();

    if (data) {
      setProfile(data);
      setUsername(data.username || '');
      setDisplayName(data.display_name || '');
      setBio(data.bio || '');
      setIsPublic(data.is_public);
    }
    setLoading(false);
  };

  const handleSave = async () => {
    if (!user) return;

    setSaving(true);

    const { error } = await supabase
      .from('profiles')
      .update({
        username,
        display_name: displayName,
        bio,
        is_public: isPublic,
      })
      .eq('id', user.id);

    if (error) {
      toast.error('Failed to update profile');
    } else {
      toast.success('Profile updated!');
    }

    setSaving(false);
  };

  if (authLoading || loading) {
    return (
      <div className="flex min-h-screen items-center justify-center bg-background">
        <Loader2 className="h-8 w-8 animate-spin text-primary" />
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-background">
      <Navbar />

      <main className="container mx-auto max-w-2xl px-4 py-8">
        <h1 className="mb-8 text-3xl font-bold">Profile Settings</h1>

        <Card>
          <CardHeader>
            <CardTitle>Your Profile</CardTitle>
          </CardHeader>
          <CardContent className="space-y-6">
            {/* Avatar */}
            <div className="flex items-center gap-4">
              <Avatar className="h-20 w-20">
                <AvatarFallback className="bg-primary/20 text-2xl text-primary">
                  {displayName?.[0]?.toUpperCase() || user?.email?.[0]?.toUpperCase() || 'U'}
                </AvatarFallback>
              </Avatar>
              <div>
                <p className="font-medium">{user?.email}</p>
                <p className="text-sm text-muted-foreground">
                  Member since {new Date(user?.created_at || '').toLocaleDateString()}
                </p>
              </div>
            </div>

            {/* Form */}
            <div className="space-y-4">
              <div className="space-y-2">
                <Label htmlFor="username">Username</Label>
                <Input
                  id="username"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  placeholder="your_username"
                />
              </div>

              <div className="space-y-2">
                <Label htmlFor="displayName">Display Name</Label>
                <Input
                  id="displayName"
                  value={displayName}
                  onChange={(e) => setDisplayName(e.target.value)}
                  placeholder="Your Name"
                />
              </div>

              <div className="space-y-2">
                <Label htmlFor="bio">Bio</Label>
                <Textarea
                  id="bio"
                  value={bio}
                  onChange={(e) => setBio(e.target.value)}
                  placeholder="Tell us about yourself..."
                  rows={3}
                />
              </div>

              <div className="flex items-center justify-between rounded-lg border border-border p-4">
                <div>
                  <Label htmlFor="isPublic" className="cursor-pointer">
                    Public Profile
                  </Label>
                  <p className="text-sm text-muted-foreground">
                    Allow others to see your profile and progress
                  </p>
                </div>
                <Switch
                  id="isPublic"
                  checked={isPublic}
                  onCheckedChange={setIsPublic}
                />
              </div>
            </div>

            <Button variant="hero" onClick={handleSave} disabled={saving}>
              {saving ? (
                <>
                  <Loader2 className="mr-2 h-4 w-4 animate-spin" />
                  Saving...
                </>
              ) : (
                <>
                  <Save className="mr-2 h-4 w-4" />
                  Save Changes
                </>
              )}
            </Button>
          </CardContent>
        </Card>
      </main>
    </div>
  );
}

import { serve } from "https://deno.land/std@0.168.0/http/server.ts";

const corsHeaders = {
  'Access-Control-Allow-Origin': '*',
  'Access-Control-Allow-Headers': 'authorization, x-client-info, apikey, content-type',
};

serve(async (req) => {
  if (req.method === 'OPTIONS') {
    return new Response(null, { headers: corsHeaders });
  }

  try {
    const { examSessionId, language, answers, totalTimeSpent, violations } = await req.json();

    const LOVABLE_API_KEY = Deno.env.get('LOVABLE_API_KEY');
    if (!LOVABLE_API_KEY) {
      return new Response(JSON.stringify({ error: 'API key not configured' }), {
        status: 500,
        headers: { ...corsHeaders, 'Content-Type': 'application/json' },
      });
    }

    const prompt = `Analyze this coding exam performance and provide detailed feedback:

Language: ${language}
Total Time: ${Math.round(totalTimeSpent / 60)} minutes
Violations: ${violations}

Questions attempted:
${answers.map((a: any, i: number) => `
Question ${i + 1} (${a.questionId}):
- Correct: ${a.isCorrect ? 'Yes' : 'No'}
- Tests: ${a.testsPassed}/${a.testsTotal}
- Compile errors: ${a.compilationErrors}
- Runtime errors: ${a.runtimeErrors}
- Time spent: ${Math.round(a.timeSpent / 60)} mins
- Errors: ${a.errorMessages?.join(', ') || 'None'}
Code:
\`\`\`
${a.code?.slice(0, 500)}
\`\`\`
`).join('\n')}

Provide:
1. Overall performance summary (2-3 sentences)
2. Specific coding mistakes found
3. Weak concepts detected
4. Time management assessment
5. 3-5 actionable improvement suggestions

Be constructive and encouraging.`;

    const response = await fetch('https://ai.gateway.lovable.dev/v1/chat/completions', {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${LOVABLE_API_KEY}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        model: 'google/gemini-2.5-flash',
        messages: [
          { role: 'system', content: 'You are a coding instructor analyzing student exam performance. Be helpful, specific, and encouraging.' },
          { role: 'user', content: prompt },
        ],
      }),
    });

    if (!response.ok) {
      console.error('AI error:', await response.text());
      return new Response(JSON.stringify({
        analysis: 'Performance analysis is temporarily unavailable.',
        weakConcepts: [],
        suggestions: ['Practice regularly', 'Review fundamentals'],
      }), { headers: { ...corsHeaders, 'Content-Type': 'application/json' } });
    }

    const data = await response.json();
    const analysis = data.choices?.[0]?.message?.content || '';

    // Extract weak concepts and suggestions
    const weakConcepts: string[] = [];
    const suggestions: string[] = [];

    const lines = analysis.split('\n');
    let currentSection = '';
    for (const line of lines) {
      if (line.includes('Weak') || line.includes('weak')) currentSection = 'weak';
      else if (line.includes('suggestion') || line.includes('Improvement') || line.includes('recommend')) currentSection = 'suggest';
      
      if (line.startsWith('-') || line.startsWith('ΓÇó') || line.match(/^\d+\./)) {
        const text = line.replace(/^[-ΓÇó\d.]+\s*/, '').trim();
        if (text && currentSection === 'weak') weakConcepts.push(text);
        else if (text && currentSection === 'suggest') suggestions.push(text);
      }
    }

    return new Response(JSON.stringify({
      analysis,
      weakConcepts: weakConcepts.slice(0, 5),
      suggestions: suggestions.slice(0, 5),
    }), { headers: { ...corsHeaders, 'Content-Type': 'application/json' } });

  } catch (error) {
    console.error('Error:', error);
    return new Response(JSON.stringify({ error: 'Analysis failed' }), {
      status: 500,
      headers: { ...corsHeaders, 'Content-Type': 'application/json' },
    });
  }
});

